INSERT INTO `#__volunteers_teams` (`id`, `parent_id`, `title`, `alias`, `status`, `department`, `acronym`, `description`, `email`, `website`, `getinvolved`, `notes`, `date_started`, `date_ended`, `state`, `ordering`, `version`, `created_by`, `created`, `modified_by`, `modified`, `checked_out`, `checked_out_time`, `ready_transition`) VALUES
	(1, 0, 'Joomla Leadership', 'joomla-leadership', 0, 0, '', '', '', '', '', '', '2005-09-01', '0000-00-00', 0, 0, 0, 430, '2014-11-03 00:00:00', 430, '2014-11-12 10:42:05', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(2, 0, 'Volunteers Portal Team', 'volunteers-portal-team', 1, 55, '', '<p>The Volunteer Portal Team is responsible for the Joomla Volunteer Portal. Track the reported issues and feature requests on <a href="https://github.com/joomla/volunteers.joomla.org/issues">Github</a>. Feel welcome to contribute!</p>', '', 'https://volunteers.joomla.org', '<p>Thank you for your interest in making this Volunteer Portal better! There are several options to get involved.</p>\r\n<h3>Join public discussion</h3>\r\n<p>If you want to provide feedback, errors or suggestions you can join the public Volunteer Portal channel on Glip: http://glip.com/joomla. Join group #volunteer-portal</p>\r\n<h3>Join the team</h3>\r\n<p>Weâ€™re currently looking for members for the Volunteer Portal Team that are interested to spend a couple hours per week to coordinate &amp; work on further improvements and features of the Volunteer Portal</p>\r\n<p>Please use the <a href="#contact" data-toggle="tab">contact form</a> if you are interested in joining the Volunteer Portal team</p>', '', '2014-11-09', '2022-12-11', 1, 0, 7, 430, '2014-11-03 00:00:00', 547, '2022-12-11 18:19:30', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(4, 0, 'Community Magazine Team', 'joomla-community-magazine-team', 1, 59, 'JCM', '<p>The JCM highlights the contributions of community volunteers, and provides information about different opportunities to support the Joomla! project and its community.</p>', 'magazine@community.joomla.org', 'https://magazine.joomla.org', '<p>The JCM team is always looking for more creative, bright, talented, and passionate community members who are interested in joining our team of committed volunteers.</p>\r\n<p>Please send an email to&nbsp;<a href="mailto:magazine@community.joomla.org?subject=JCM%20team%20inquiry" style="margin: 0px; padding: 0px; color: #136aa5;">magazine@community.joomla.org</a>&nbsp;if there is an existing role you would be interested in helping with, or if you have an idea for a new topic or feature for the JCM that you would like to help bring to the community!</p>', '', '2010-07-01', '0000-00-00', 1, 0, 10, 430, '2014-11-06 00:00:00', 669, '2022-03-29 20:52:18', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(5, 0, 'Events Team', 'events-team', 1, 59, '', '<p>Oversees approvals and publishing of JoomlaDays, Joomla User Groups and related official global Joomla events.</p>', 'events-team@community.joomla.org', 'https://community.joomla.org/events.html', '', '', '0000-00-00', '0000-00-00', 1, 0, 4, 430, '2014-11-06 00:00:00', 669, '2022-03-29 20:55:18', 0, '0000-00-00 00:00:00', '2016-12-01 08:47:54'),
	(6, 0, 'Forum Team', 'forum-team', 1, 55, '', '<p>Website for technical Joomla support by community to other community members</p>', '', 'https://forum.joomla.org/', '', '', '0000-00-00', '0000-00-00', 1, 0, 2, 430, '2014-11-08 21:55:58', 1035, '2017-08-11 09:58:54', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(7, 0, 'Marketing Team', 'marketing', 1, 59, '', '<h2 style="font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; color: #333333;">Use your marketing skills to help promote Joomla!</h2>\r\n<h3 style="font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; color: #333333;">Join the Marketing Team!</h3>\r\n<p>If you have some experience in a marketing environment and have some time to contribute we need your help. No matter your time availability, we would love to have you use your skills in marketing to help promote Joomla! Through its second decade.</p>\r\n<p>If you have any of these skills (or others related to marketing that we didnâ€™t list above) please contact us using the link below and let us know a bit about yourself and weâ€™ll help you get plugged into the best team for your skills.</p>\r\n<p>What? You donâ€™t have ANY of these skills but still want to help let everyone in the world know how great Joomla! Is? You can contact us too and tell us about your skills and weâ€™ll see if we have a place for you. Even though we are focused on marketing we still need help in translating, team management, some coding and other basic web-type-stuff tasks that you might be able to help. And weâ€™ll even help you learn some of the skills that go into the marketing process.</p>\r\n<p>To find where you fit on the Marketing Team please visit our team area at&nbsp;<a href="teams/marketing" title="Joomla! Marketing Team">https://volunteers.joomla.org/teams/marketing</a>&nbsp;and take a look at the various "sub-teams".&nbsp;Ready to get started ?</p>\r\n<p><a href="https://forms.gle/XxPJjwtB8HDpcjqL9" target="_blank" rel="noopener noreferrer" class="btn btn-primary btn-large">Apply Now!</a></p>\r\n<p>&nbsp;</p>', 'marketing@community.joomla.org', 'https://docs.joomla.org/Marketing', '', '', '0000-00-00', '0000-00-00', 1, 0, 15, 430, '2014-11-08 21:56:26', 669, '2022-03-29 20:53:20', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(8, 0, 'Resource Directory Team', 'resource-directory-team', 2, 55, 'JRD', '<p>The Joomla! Resources&nbsp;Directory (JRD) exists to help you&nbsp;locate professional service providers so you can&nbsp;connect and do more&nbsp;with your Joomla! CMS. Browse through approved listings by category to find a Registered provider or use the search to find someone near you, or.&nbsp;All Registered Providers go through a thorough&nbsp;Approval Process&nbsp;to ensure the viability of each listing.&nbsp;Search Tips.</p>\r\n<p>To build this Directory, we have depended upon the volunteer contributions of a dedicated team and software developers across the world.</p>', '', 'https://resources.joomla.org', '', '', '2013-11-17', '2020-08-01', 1, 0, 8, 430, '2014-11-08 21:57:23', 2198, '2020-10-16 20:45:59', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(9, 0, 'Showcase Directory Team ', 'site-showcase-team', 1, 55, 'JSD', '<p>A showcase of Joomla sites to give potential Joomla users an idea about Joomla &amp; possible use.</p>', 'sebastien.lapoux@community.joomla.org', 'https://showcase.joomla.org', '', '', '2014-04-11', '2022-12-11', 1, 0, 14, 430, '2014-11-08 21:57:40', 547, '2022-12-11 18:15:39', 0, '0000-00-00 00:00:00', '2016-11-21 10:21:22'),
	(10, 0, 'Social Media Team', 'social-media-team', 1, 59, '', '<p>Team that looks after the communication via social media channels.</p>', 'social@joomla.org', 'https://docs.joomla.org/Social_Media_Working_Group', '<p>Help Wanted! Please check our <a href="https://github.com/joomla/socialmedia/issues">repository</a> to find a list of tasks.</p>', '', '0000-00-00', '0000-00-00', 1, 0, 6, 430, '2014-11-08 21:58:00', 669, '2022-03-29 20:53:34', 0, '0000-00-00 00:00:00', '2016-11-18 08:47:52'),
	(11, 0, 'Template Directory Team', 'template-directory-team', 2, 55, 'JTD', '<p>[in development] The Joomla Template Directory will be a place for users to find Joomla templates.</p>', '', '', '<p>If you would like to get involved in this team, please send us an email with your proposal to&nbsp;jtd@community.joomla.org</p>', '', '0000-00-00', '2020-11-16', 1, 0, 7, 430, '2014-11-08 21:58:24', 2198, '2020-12-09 09:57:39', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(12, 7, 'Think Bigger Team', 'think-bigger-team', 0, 53, 'JTB', 'We want to help promote Joomla as the CMS and community that is "helping to make the world a better place".', '', '', '', '', '2013-11-11', '2016-08-01', 1, 0, 2, 430, '2014-11-08 21:58:39', 485, '2016-09-01 12:06:59', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(13, 0, 'Joomla User Groups Team', 'user-groups-team', 1, 59, 'JUG', '<p>We maintain and support a directory of all local Joomla! User Groups that are being organised by the community to meet Joomla! users in real life to share Joomla! knowledge. &nbsp;</p>\r\n<p>We support and advise Joomla! User Group Organisers.</p>', 'jugs@community.joomla.org', 'https://community.joomla.org/user-groups.html', '<p id="docs-internal-guid-ccc90d30-ca4b-af57-aec5-a0cb50d6cc57" dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">Long Term JUG Team Member</span></p>\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">Become a JUG Team Member</span></p>\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">JUG Team Member Expectations/Responsibilities</span></p>\r\n<p>&nbsp;</p>\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">The JUG Teamâ€™s activities are centred around the Ticketing System and this is essential to our operations. We need people that are willing to commit to checking emails and for new tickets daily and to reply/follow up promptly in a very timely manner. Inactivity and lack of follow through is not acceptable in this group and we move people to â€œContributorâ€ when activity becomes less frequent.</span></p>\r\n<p>&nbsp;</p>\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">Communications</span></p>\r\n<ul style="margin-top: 0pt; margin-bottom: 0pt;">\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">Polite, friendly, clear communication at all times (including on personal social media)</span></p>\r\n</li>\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">Check your email at least daily and respond to anything that needs action</span></p>\r\n</li>\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">Attend team meetings or give advance warning for absence. If two or more meetings are missed without apologies you will be moved to the â€œhonour rollâ€ and be in the Organisers and/or Contributor Teams.</span></p>\r\n</li>\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">Promptly address new tickets and listing updates.</span></p>\r\n</li>\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">Answer tickets assigned to you within 24 hours. </span></p>\r\n</li>\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">Follow up with tickets assigned to you as needed and continually/regularly.</span></p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">JUG Team Specific</span></p>\r\n<ul style="margin-top: 0pt; margin-bottom: 0pt;">\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">Keep documentation on docs.joomla.org up to date - standing item on agenda.</span></p>\r\n</li>\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">Update JUG team pages on https://docs.joomla.org/Joomla_User_Group_Team</span></p>\r\n</li>\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">Learn trademark &amp; licensing requirements for JUG registration</span></p>\r\n</li>\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">Assist in translating content (when fluent in more than one language)</span></p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">JUG Organiser Mentoring</span></p>\r\n<ul style="margin-top: 0pt; margin-bottom: 0pt;">\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">Outreach &amp; forum support - for new and existing organisers (subscribe to forum at http://forum.joomla.org/viewforum.php?f=562)</span></p>\r\n</li>\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">1-2-1 â€˜hand holdingâ€™ for new JUG organisers</span></p>\r\n</li>\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">Assist with creating, sharing and updating resources for JUG organisers</span></p>\r\n</li>\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">Maintaining docs.joomla.org pages by adding their information/resources</span></p>\r\n</li>\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">Assist with monthly JUG team newsletter</span></p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">With the upcoming migration to the new Registered Joomla User Group directory, the increase in registrations and other exciting news, there is now a chance to be part of this team.</span></p>\r\n<p>&nbsp;</p>\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">Please fill out the</span><a href="http://goo.gl/forms/PeHlU1NJwg" style="text-decoration: none;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;"> </span><span style="font-size: 11pt; font-family: Arial; color: #1155cc; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline;">member application form</span></a><span style="font-size: 11pt; font-family: Arial; color: #1155cc; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: underline; vertical-align: baseline;"> </span><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">if you are interested in being a member of the JUG Team. </span></p>\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">Thank you.</span></p>\r\n<p>&nbsp;</p>', '', '0000-00-00', '0000-00-00', 1, 0, 10, 430, '2014-11-08 21:58:58', 669, '2022-03-29 20:55:36', 0, '0000-00-00 00:00:00', '2016-11-07 11:26:49'),
	(14, 44, 'Vulnerable Extensions List Team', 'vulnerable-extensions-list-team', 1, 55, 'VEL', '<p>Vulnerable Extensions List Team dealing with all 3rd party developer components, modules, plugins and templates.&nbsp;<br />Note due to the sensitive nature of the work, meeting notes will not normally be published. <br /><br /></p>', '', 'https://vel.joomla.org/', '<p>Please apply for roles at <a href="http://bit.ly/2RX8x6X">http://bit.ly/2RX8x6X</a><br />You can submit Vulnerable Extension List reports by visiting vel.joomla.org</p>', '', '0000-00-00', '2020-07-16', 1, 0, 7, 430, '2014-11-08 21:59:19', 695, '2020-07-16 13:04:30', 0, '0000-00-00 00:00:00', '2016-11-19 00:24:30'),
	(15, 159, 'Webmasters Team', 'webmasters-team', 2, 55, '', '<p>This group consist of representatives for each Joomla! property (websites, infrastructure and otherwise).<br />We are responsible for standardization, providing guidelines, defining procedures, supervise the implementation of various topics (updates, extensions and more). The group for information and coordination.<br />The Joomla Property Management policy is displayed in the <a href="https://www.opensourcematters.org/organisation/directors/policies/297-joomla-property-management-policy.html" target="_blank" rel="nofollow noopener">OpenSourceMatters website.</a><br /><br />Any issue with a website can be reported on GitHub: <a href="https://github.com/joomla/joomla-websites" target="_blank" rel="nofollow noopener">https://github.com/joomla/joomla-websites<br /></a>A list of all websites and the related team, can be found here: <a href="https://docs.joomla.org/Joomla:The_Joomla_Websites">https://docs.joomla.org/Joomla:The_Joomla_Websites</a></p>', 'operations.dc@community.joomla.org', 'https://www.joomla.org', '<p>Please submit suggestions and fixes on GitHub. &nbsp;Many of our websites have repositories on GitHub and we have a single repository for reporting issues. Please see&nbsp;<a href="https://github.com/joomla/joomla-websites/">https://github.com/joomla/joomla-websites</a>&nbsp;for more information on our websites or to report an issue.</p>', '', '2015-09-01', '0000-00-00', 1, 0, 12, 430, '2014-11-08 21:59:39', 547, '2022-12-11 18:21:51', 0, '0000-00-00 00:00:00', '2016-11-07 07:26:44'),
	(16, 78, 'Certification Platform Team', 'certification-platform-team', 1, 56, 'CPT', '<p>The Certification Platform Team is responsible to create and maintain the certification platform which consist of Exam Delivery, Learning Partners Dashboard, Payments, Enrollment and maintaining directory of Certified Users.</p>', 'certification@community.joomla.org', 'https://exam.joomla.org', '<p><strong>Ready to volunteer, or have questions?</strong> Contact Sam Suresh by email at sam.suresh<span id="domain">@community.joomla.org&nbsp;</span><span id="domain"> </span>today!<br /><br /></p>', '', '2015-09-01', '2017-11-24', 1, 0, 4, 430, '2014-11-08 21:59:56', 669, '2017-11-24 19:33:33', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(17, 78, 'Certification Marketing Team', 'certification-marketing-team', 0, 56, '', '<p>We have the pleasure to support the Joomla! Certification Program with marketing and communication. Our team will be having an ongoing dialogue with the community to get feedback on the Joomla! Certification.</p>', '', 'https://certification.joomla.org/', '', '', '0000-00-00', '2017-11-30', 1, 0, 2, 430, '2014-11-08 22:00:10', 669, '2017-11-30 21:24:16', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(18, 78, 'Certification Exam Team', 'certification-exam-team', 1, 56, '', '<p>This group is responsible for all the different Certifications (Administrator, Developerâ€¦) Defining the areas for the role. Creating the questions for the tests in English, Spanish and other languages. Plan for internationalization of the program.</p>', '', '', '<h1 id="docs-internal-guid-3821f24d-8127-a549-0f1b-584fdb0822de" dir="ltr" style="line-height: 1.1454545454545455; margin-top: 11pt; margin-bottom: 17pt;"><span style="font-size: 19.5pt; font-family: Arial; color: #333333; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">Volunteers: Certification Exam Team (CET) </span><span style="font-size: 8pt; font-family: Arial; color: #ffffff; background-color: #3a87ad; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">Official</span></h1>\r\n<p dir="ltr" style="line-height: 1.6758620689655173; margin-top: 0pt; margin-bottom: 21pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">The Certification Exam Team (CET) is part of the Joomla! Certification Program and is responsible for creating the questions and answers for the various Joomla! exams. We also monitor the exam results and update the questions and/or answers and handle the feedback from exam candidates.</span></p>\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">What are we looking for</span></p>\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">Immediately</span></p>\r\n<ul style="margin-top: 0pt; margin-bottom: 0pt;">\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">Exam Team core members: to coordinate Exam Team activities, write an review exam questions<br /></span></p>\r\n</li>\r\n</ul>\r\n<ul style="margin-top: 0pt; margin-bottom: 0pt;">\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">Translators: to translate exams into other common languages (currently Italian, French, German and Dutch)</span></p>\r\n</li>\r\n</ul>\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;"> </span><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">&nbsp;&nbsp;&nbsp; </span></p>\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">Which type of people are we looking for</span></p>\r\n<ul style="margin-top: 0pt; margin-bottom: 0pt;">\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">willing to be involved long term, at least one year (not compulsory for translators) </span></p>\r\n</li>\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">have passed the relevant certification exam (e.g. Administration Exam) or are willing to pass it </span></p>\r\n</li>\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">be generally available for weekly team meetings (Wednesdays at 20:00 CET) and/or other forms of contact</span></p>\r\n</li>\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">English: reading / writing and speaking at least as a second language level</span></p>\r\n</li>\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">have a lot of staying power and patience because quality goes over quantity</span></p>\r\n</li>\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">team spirit</span></p>\r\n</li>\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">not a Joomla! Learning Partner (sorry, due to a possible conflict of interest) </span></p>\r\n</li>\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">knowledge and experience in the relevant exam subject (Admin., Developer, Templates) </span><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;"><br class="kix-line-break" /></span><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;">for the &nbsp;Admin exam.</span></p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><a href="https://docs.google.com/forms/d/1t2qDuP-BPpCJp2S1mFexCYuG27-e3Ama2GfB8yxvLKs/edit" target="_blank" rel="noopener noreferrer">Application Form</a></p>', '', '0000-00-00', '2017-11-24', 1, 0, 7, 430, '2014-11-08 22:00:22', 669, '2017-11-24 19:33:02', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(19, 78, 'Certification Operations Team', 'certification-operations-team', 1, 56, 'COT', '<p>Do the liaison for interested trainers, Joomla! Learning Partners (JLP), JoomlaDays, Joomla! User Groups and Supervisors answering questions about the certification process, providing contracts, etc. This is the main outreach team, once the certification is launched.</p>', 'certification@community.joomla.org', 'https://certification.joomla.org/', '<p>There are several ways you can contribute to the Joomla! Certification Operations Team.</p>\r\n<p>A permanent call for volunteers is open at <a href="https://certification.joomla.org/contribute/volunteer">https://certification.joomla.org/contribute/volunteer</a></p>\r\n<p>There you can choose in which area you would to be involved.</p>\r\n<h3>Certification Ambassadors</h3>\r\n<p>Certification Ambassadors are "facilitators", serving as link between the partner network (JLPs, JUG &amp; JoomlaDays organisers) and the Certification Operations Team.</p>\r\n<p>If you would like to contribute as Certification Ambassador in your region, just fill out the form at the following page: <a href="https://certification.joomla.org/contribute/regional-coordinator">https://certification.joomla.org/contribute/regional-coordinator</a></p>', '', '0000-00-00', '2017-11-30', 1, 0, 6, 430, '2014-11-08 22:00:32', 669, '2017-11-30 20:47:42', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(20, 0, 'Finance Team', 'fit', 2, 52, 'FiT', '<p>The Finance Team is responsible for managing the finances of the Joomla project including budgets, accounting, oversight, and policy.</p>', '', '', '<p style="line-height: 15.8079996109009px;">FiT team members may perform a number of duties such as:&nbsp;</p>\r\n<ul style="line-height: 15.8079996109009px;">\r\n<li><span style="line-height: 1.3em;">managing finances</span></li>\r\n<li><span style="line-height: 1.3em;">managing conflict of interest</span></li>\r\n<li><span style="line-height: 1.3em;">preparing financial policy and oversight</span></li>\r\n<li><span style="line-height: 1.3em;">implementing accounting best practices</span></li>\r\n<li><span style="line-height: 1.3em;">reconciling bank records</span></li>\r\n<li><span style="line-height: 1.3em;">preforming day-to-day accounting&nbsp;</span></li>\r\n<li><span style="line-height: 1.3em;">managing corporate accounts and relationships</span></li>\r\n<li><span style="line-height: 1.3em;">managing investments</span></li>\r\n</ul>\r\n<p>The Fit is a small team but we are always looking for dedicated&nbsp;volunteers.</p>\r\n<p><strong>If you are interested to join, please contact the FiT team Group Leader&nbsp;directly via their profile.</strong></p>\r\n<p>Note: All&nbsp;members of the Finance Team must&nbsp;<span style="line-height: 1.3em;">undergo a</span><span style="line-height: 1.3em;">&nbsp;background check before joining and all new members will have a 3-month&nbsp;<em>provisional</em>&nbsp; status to ensure the right fit for the team.</span></p>', '', '2014-01-01', '2017-03-23', 1, 0, 2, 430, '2014-11-08 22:00:41', 1035, '2017-08-11 09:58:09', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(21, 0, 'Trademark & Licensing Team', 'trademark-team', 1, 55, '', '<p>The Trademark and Licensing team manages defending Joomla-related trademarks and licensing the Joomla Community to use the Joomla! name and brandmark in their domain name and on their websites.</p>', 'trademark@opensourcematters.org', 'https://tm.joomla.org', '<p>The trademark team manages and defends Joomla-related trademarks and licensing on behalf of the Joomla! Community. We want to make sure that the world respects the policies and regulations we have around the use of the Joomla! name and brand mark. &nbsp;For more information check out the Trademark Team website at&nbsp;<a href="https://tm.joomla.org/" target="_blank" rel="noopener noreferrer" title="Trademark Team Website">https://tm.joomla.org</a><br /><br />The trademark team has a number of roles needing to be filled from team liaisons and license administration to business mentors. Many roles require less than a couple hours per week.&nbsp; No prior experience necessary - we will teach you what you need to know. Contact <a href="mailto:trademark@opensourcematters.org">trademark@opensourcematters.org</a> to learn more.<br /><br /><br /><br /></p>', '', '2005-09-01', '0000-00-00', 1, 0, 11, 430, '2014-11-08 22:00:55', 669, '2022-03-29 20:51:23', 0, '0000-00-00 00:00:00', '2016-11-22 20:17:57'),
	(22, 0, 'Joomla! World Conference Team', 'world-conference-team', 2, 54, 'JWC', '<p>Joomla World Conference Team is a standing team organizing the JWC each year. The goal is to be a relevant event that tries to empower local and regional areas and to try and bridge them into the global community.</p>', '', 'https://conference.joomla.org', '<p>Currently all positions are filled.</p>', '', '2011-10-01', '2020-09-22', 1, 0, 12, 430, '2014-11-08 22:01:16', 468, '2020-09-22 12:22:14', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(23, 0, 'Governance Working Group', 'governance-working-group', 0, 52, 'GWG', '<p>&nbsp;</p>\r\n<p>The Governance Working Group works at analyzing and creating input for future changes to the Joomla Project overall structure and processes.</p>\r\n<p>Our mission/purpose:</p>\r\n<p>To take on challenges and provide solutions regarding Governance, Community Standards and Accountability.</p>\r\n<p>To provide assistance to have a well governed, accountable, safe, vibrant Joomla community and Joomla leadership now and in the future.</p>', 'jennifermarriott@gmail.com', '', '<p>To be added to this group or the honor roll for this group please email:<br />jennifermarriott@gmail.com</p>', '', '2014-01-01', '2014-06-01', 1, 0, 5, 430, '2014-11-08 22:01:40', 490, '2016-11-22 19:11:30', 0, '0000-00-00 00:00:00', '2016-11-14 12:23:15'),
	(24, 155, 'Google Summer of Code Joomla Team', 'google-summer-of-code-joomla-team', 1, 51, 'GSoC', '<p>GSoC is a global program runs completely online, an initiative started by Google back in 2005. GSoC Program is designed and sponsored by Google. Goal of the program is to encourage college students of any age in contributing to Free Open Source Software (FOSS) projects.</p>\r\n<p>Joomla\'s GSoC team helps in Joomla\'s Participation with GSoC Program, we are team of volunteers where each person has a dedicated role, and all of us work towards developing features during the summer which help in improving Joomla. Each project being implemented for Joomla! has Mentors who help/guide college students to achieve the goal.</p>\r\n<p>For information about the 2021 edition, please see&nbsp;<a href="https://docs.joomla.org/GSoC_2021" target="_blank" rel="noopener" style="color: #729e52; cursor: pointer; font-family: proxima-nova, \'Helvetica Neue\', HelveticaNeue, Helvetica, Arial, sans-serif; font-size: 15px; white-space: pre-wrap;">https://docs.joomla.org/GSoC_2021</a></p>', 'gsoc@opensourcematters.org', '', '<p>To get involved in the team, drop us an email.&nbsp;<a href="mailto:philip.walton@community.joomla.org"><span style="color: #5f6368; font-family: Roboto, RobotoDraft, Helvetica, Arial, sans-serif; text-align: center; white-space: nowrap;">philip.walton@community.joomla.org</span></a><span style="caret-color: auto;">&nbsp; We already have an exciting list of mentors on board.</span></p>', '', '0000-00-00', '0000-00-00', 1, 0, 7, 430, '2014-11-08 22:02:13', 669, '2021-12-05 16:12:14', 0, '0000-00-00 00:00:00', '2017-02-01 12:27:38'),
	(25, 0, 'Bug Squad ', 'bug-squad', 1, 51, 'JBS', '<p>The purpose of the Joomla! Bug Squad is to reduce the number of bugs in Joomla.</p>\r\n<p>Learn more about the Bug Squad on our portal!</p>', 'bugsquad@community.joomla.org', 'https://docs.joomla.org/Portal:Bug_Squad', '<p>Joomla uses GitHub as its code repository and for reporting bugs. You will need a GitHub user account to report issues on the CMS Issue tracker. You will use your GitHub user account to submit patches (PRs) against the Joomla code repository for bug fixes. You will use your GitHub user account to test patches using the Joomla! Patch Tester. Send an email request to the Bug Squad requesting membership in the Joomla! Bug Squad. You will have to provide your GitHub Username.</p>', '', '2008-06-01', '0000-00-00', 1, 0, 7, 430, '2014-11-08 22:03:51', 669, '2018-03-24 18:29:16', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(26, 0, 'Distribution Working Group', 'distribution-working-group', 0, 51, '', 'The Distribution Working Group is focused on making sure that all channels distributing Joomla - download pages, hosting companies offering Joomla SaaS services, template companies with quickstart packages etc. - are providing the latest Joomla! versions within their major releases.', '', '', '', '', '0000-00-00', '2016-08-28', 1, 0, 1, 430, '2014-11-08 22:04:14', 669, '2016-08-28 14:29:30', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(27, 28, 'Documentation Translation Team', 'documentation-translation-team', 1, 51, 'JDT', '<p>The Documentation Translation Team translates the English Documentation into several other languages</p>', 'sandra.thevenet@community.joomla.org', 'https://docs.joomla.org/JDOC:Documentation_Translators', '<p>Make a gift to your local community by localising the Documentation in your language!<br /><br />To join us and become a translator, first, create and account <a href="https://docs.joomla.org/index.php?title=Special:UserLogin&amp;type=signup&amp;returnto=Main+Page">here</a>, then visit and read this<a title="Joomla Documentation Translators" href="https://docs.joomla.org/JDOC:Documentation_Translators"> page about translators</a>. Add your username in the right language and we will grant you translator permissions. <br />Please be sure to read the required reading list.</p>\r\n<p><em>Note: only active and top contributors to translation in the last year are considered as official JDocs contributors (a minimum of 1,000 edits a year is required).</em></p>', '', '0000-00-00', '0000-00-00', 1, 0, 8, 430, '2014-11-08 22:04:31', 530, '2019-01-17 11:28:55', 0, '0000-00-00 00:00:00', '2016-12-01 20:53:01'),
	(28, 0, 'Documentation Team', 'documentation-team', 1, 51, 'JDocs', '<div data-block="true" data-editor="9ve1m" data-offset-key="4jim7-0-0">\r\n<div data-offset-key="4jim7-0-0">The&nbsp;Documentation Team is part of the&nbsp;<a href="departments/production">Production Department</a>. Our team handles creating and maintaining all the official Joomla! documentation. This includes documentation for end-users, administrators, third-party developers and administrator Help Screens. Additionally, the team also maintains&nbsp;<a href="https://api.joomla.org/">api.joomla.org</a>.&nbsp;</div>\r\n</div>\r\n<div data-block="true" data-editor="9ve1m" data-offset-key="76nd6-0-0">\r\n<div data-offset-key="76nd6-0-0">&nbsp;</div>\r\n</div>\r\n<div data-block="true" data-editor="9ve1m" data-offset-key="dapj8-0-0">\r\n<div data-offset-key="dapj8-0-0">Our primary focus is&nbsp;<a href="https://docs.joomla.org/">docs.joomla.org</a>. You <strong>DO NOT</strong> need to be a member of this team to contribute to&nbsp;<a href="https://docs.joomla.org/">JDocs</a>, it is a wiki. If you can improve something on JDocs, please <strong><a href="https://docs.joomla.org/index.php?title=Special:UserLogin&amp;type=signup&amp;returnto=Main+Page">create an account</a></strong> and <strong>contribute</strong>.</div>\r\n</div>', 'mike.brandner@community.joomla.org', 'https://docs.joomla.org/Documentation_Working_Group', '<p>To start contributing to JDocs, you just have to create an account <a href="https://docs.joomla.org/index.php?title=Special:UserLogin&amp;type=signup&amp;returnto=Main+Page" title="Jdocs">here</a>.</p>\r\n<ul>\r\n<li><a href="https://docs.joomla.org/index.php?title=Special:UserLogin&amp;type=signup&amp;returnto=Main+Page"></a>We are looking for volunteers to <strong>update and review</strong> the existing content, <strong>write</strong> new tutorials or articles about new features, as well as <strong>translators</strong> to localise as many pages as possible to the benefit of all communities.</li>\r\n<li>We are also looking for volunteers to help <strong>updating the Help Screens</strong>, which are also served in the Joomla! backend, in order to provide up to date information to Joomla! users.</li>\r\n</ul>\r\n<p><br />For more information, please see:</p>\r\n<ul>\r\n<li><a href="https://docs.joomla.org/JDOC:How_to_Contribute_to_Joomla!_Documentation" title="How to contribute to Joomla! Documentation">How to contribute to Joomla! Documentation</a></li>\r\n<li><a href="https://docs.joomla.org/JDOC:Documentation_Translators" title="localisation of the Documentation">How to contribute to the localisation of the Documentation</a></li>\r\n</ul>\r\n<p>Learn more:</p>\r\n<ul>\r\n<li><a href="https://docs.joomla.org/Documentation_Working_Group" title="The Documentation Team and its purpose, mission and roles">The Documentation Team and its purpose, mission and roles</a></li>\r\n<li><a href="https://docs.joomla.org/JDOC:Docs_Wiki_Roadmap" title="The Documentation Roadmap">The Documentation Roadmap</a></li>\r\n</ul>\r\n<p><br />Whatever is your level and skills, <strong>your help will be highly appreciated.</strong><br />Do not hesitate to <strong>contact us</strong> and <strong>join JDocs</strong>.</p>', '', '0000-00-00', '0000-00-00', 1, 0, 18, 430, '2014-11-08 22:04:49', 2356, '2022-07-03 16:57:04', 0, '0000-00-00 00:00:00', '2016-11-17 09:51:43'),
	(29, 50, 'Framework Working Group', 'framework-working-group', 0, 51, '', '<p>This team is responsible for maintaining the Joomla Framework.</p>', 'niels.braczek@community.joomla.org', 'https://framework.joomla.org', '<p>All Joomla! Framework code is hosted on GitHub and can be found at <a href="https://github.com/joomla-framework">https://github.com/joomla-framework</a>.</p>\r\n<p>Discussions about the Framework occur via a Google Group which can be found at <a href="https://groups.google.com/forum/#!forum/joomla-dev-framework">https://groups.google.com/forum/#!forum/joomla-dev-framework</a>.</p>\r\n<p>Lastly, you can follow the Framework via social media channels, including:</p>\r\n<ul>\r\n<li>Facebook at&nbsp;<a href="https://www.facebook.com/JoomlaFramework">https://www.facebook.com/JoomlaFramework</a></li>\r\n<li><a href="https://www.facebook.com/JoomlaFramework"></a>Twitter at&nbsp;<a href="https://twitter.com/JoomlaFramework">https://twitter.com/JoomlaFramework</a></li>\r\n</ul>', '', '2013-01-01', '0000-00-00', 1, 0, 7, 430, '2014-11-08 22:05:18', 2356, '2022-03-24 20:03:09', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(30, 15, 'Issue Tracker Team', 'issue-tracker-team', 2, 55, 'JIssues', '<p>This team is responsible for the development and maintenance of Joomla\'s Issue Tracking system.</p>', 'michael.babker@joomla.org', 'https://issues.joomla.org', '<p>The live application is deployed and in use at <a href="https://issues.joomla.org">https://issues.joomla.org</a> and its code is open source and shared under the GPL v2 license. &nbsp;If you are interested in joining development on the project, please visit&nbsp;<a href="https://github.com/joomla/jissues">https://github.com/joomla/jissues</a> and review the current issue and pull request backlogs as these are the active tasks for the group; all discussion occurs on GitHub!</p>', '', '2012-10-05', '2020-04-30', 1, 0, 6, 430, '2014-11-08 22:05:33', 2198, '2020-04-29 23:51:40', 0, '0000-00-00 00:00:00', '2016-11-07 07:26:07'),
	(31, 0, 'Search Working Group', 'search-working-group', 0, 51, '', 'Now that Finder has been integrated into Joomla 2.5 in the form of Smart Search, the time has come to look forward to Joomla 3.x and how we want search to work in that series.', '', 'https://docs.joomla.org/Search_Working_Group', '', '', '0000-00-00', '2016-08-25', 1, 0, 1, 430, '2014-11-08 22:05:57', 669, '2016-08-25 00:53:22', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(32, 0, 'Security Strike Team', 'security-strike-team', 1, 51, 'JSST', '<p>This team is for experienced Joomla users and developers who want to help test and fix reported security issues.</p>', 'security@joomla.org', 'https://developer.joomla.org/security.html', '', '', '2008-08-01', '0000-00-00', 1, 0, 5, 430, '2014-11-08 22:06:25', 430, '2017-02-15 22:42:59', 0, '0000-00-00 00:00:00', '2016-11-10 16:33:45'),
	(33, 0, 'SQL Optimization Working Group', 'sql-optimization-working-group', 0, 51, '', '<p>In the SQL optimization working group we are mainly focused on the above mentioned fact. Our vision is to provide the community a faster way in which the CMS interacts with the DB by reducing the database management system based overheads.</p>', '', 'https://docs.joomla.org/SQL_Optimisation_Working_Group', '', '', '0000-00-00', '2016-12-29', 1, 0, 1, 430, '2014-11-08 22:06:41', 669, '2016-12-29 22:09:06', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(34, 0, 'Automated Testing Team', 'automated-tests-working-group', 1, 51, 'ATT', '<p>The ATT tries to improve the quality of the Joomla CMS and all its surrounding software, including that of third party developers. We try to do this by using automated tools to run tests, check codestyle and other requirements, as well as automatic dependency updates. We develop our own tools to help in this where necessary and document all of this to provide extension developers help in finding good setups which work for them. The longterm goal is always to increase the quality of the software and its releases and to reduce the work necessary to get there.</p>\r\n<p>The team has many diverse tasks, from writing unit- and systemtests as well as deployment tools like Joomla-Browser and Jorobo, to configuring and deploying third party tools and setting up our own servers for testing purposes. If you are interested in phpUnit, Codeception, Drone CI, phpcs, renovatebot or Robo.li, this team is the place for you.</p>', '', 'https://docs.joomla.org/Automated_Tests_Working_Group', '<p>If you want to learn how to do automated tests and help us improve all of this for the Joomla CMS, join us. You can contact us by e-mail to hannes.papenberg at community.joomla.org.</p>\r\n<p>&nbsp;</p>', '', '0000-00-00', '0000-00-00', 1, 0, 7, 430, '2014-11-08 22:06:58', 3376, '2022-05-05 18:36:35', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(35, 36, 'Translation Tools Working Group', 'translation-tools-working-group', 0, 51, '', '<p>The Translation Tools Working Group is focused on Improving processes in Translating the Joomla Software and support the enhancement of the Joomla CMS multilingual system.</p>', '', 'https://docs.joomla.org/Translation_Tools_Working_Group', '<p>If you want to join contact javier.gomez at community.joomla.org</p>', '', '0000-00-00', '2016-11-23', 1, 0, 2, 430, '2014-11-08 22:07:24', 669, '2016-11-23 08:47:59', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(36, 0, 'Core Translation Team', 'core-translation-team', 1, 51, '', '<p>This group has been moved to be part of the Joomla Translation Program: <a href="teams/joomla-translation-program-team">https://volunteers.joomla.org/teams/joomla-translation-program-team</a><br />With an own Volunteer listing page: <a href="teams/joomla-cms-language-team">https://volunteers.joomla.org/teams/joomla-cms-language-team</a> <br /><br /></p>', '', 'https://volunteers.joomla.org/teams/joomla-cms-language-team', '', '', '0000-00-00', '2021-03-01', 1, 0, 8, 430, '2014-11-08 22:07:46', 2198, '2021-03-07 11:43:29', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(37, 0, 'Unit Tests Working Group', 'unit-tests-working-group', 0, 51, '', 'The Unit Tests Working Group is a Production Working Group responsible for seeing that the Unit Tests for Joomla\'s code projects, primarily the CMS and Framework, are created and maintained.', '', 'https://docs.joomla.org/Unit_Tests_Working_Group', '<p>Please see the <a href="working-groups/automated-tests-working-group">Automated Testing Working Group</a> for more details.</p>', '', '2012-05-01', '2015-05-01', 1, 0, 0, 430, '2014-11-08 22:07:57', 447, '2015-05-18 17:45:06', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(38, 0, 'Update Working Group', 'update-working-group', 0, 51, '', 'For further information see Update Working Group Page.', '', 'https://docs.joomla.org/Update_Working_Group', '', '', '0000-00-00', '2016-08-28', 1, 0, 1, 430, '2014-11-08 22:08:15', 669, '2016-08-28 14:16:57', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(39, 0, 'User Experience Team', 'user-experience-working-group', 2, 51, 'JUX', '<p>The Joomla User Experience (JUX) Working Group is focused on lowering the barrier of entry for new users by improving the Joomla user experience and interface, taking it to a new level of intuitiveness and ease of use, as well as optimize and streamline the workflows for our site integrators and seasoned users.</p>\r\n<h3>Ahead of the Curve</h3>\r\n<p>Our goal is to keep Joomla always ahead of the curve, and to achieve that, we must brainstorm and bring about a revolution in the Joomla interface. By harnessing the power of the UX processes, and above all listening to our users, we can, together, shape the future of Joomla and inspire people to achieve great things.</p>', '', 'https://ux.joomla.org', '<p>The Joomla User Experience Team is looking for experienced Joomla users and UX professionals to help in various areas of the UX process for the Joomla platform.&nbsp;</p>\r\n<h3>Role Information:</h3>\r\n<ul>\r\n<li>Research, test and gather feedback from Joomla users to better understand their goals, motivations and behaviors and create analysis reports for the community.</li>\r\n<li>Develop strategies to transform user based goals into real world solutions which can be implemented into the Joomla core.</li>\r\n<li>Collaborate with Joomla production teams and other areas of the community through designs, interactive prototypes and recommendations based on user research.</li>\r\n</ul>\r\n<h3>Qualifications</h3>\r\n<p>We are seeking people with backgrounds in UX, as well as specialists in various areas to assist with a number of different tasks relating to upcoming releases of the Joomla platform.&nbsp;</p>\r\n<h3>Ideal JUX team member candidates:</h3>\r\n<ul>\r\n<li>Are able to commit time to the project consistently</li>\r\n<li>Possess excellent communication and collaborative skills</li>\r\n<li>Have high standards of quality with strong attention to detail</li>\r\n<li>Have a flexible, friendly approach and a team oriented attitude</li>\r\n<li>Are creative, conceptual and forward thinking</li>\r\n<li>Are proactive, self-starting and motivated</li>\r\n<li>Are empathetic, supportive and compassionate</li>\r\n</ul>\r\n<p><strong>Experience in one or more of these areas</strong></p>\r\n<ul>\r\n<li>User Research</li>\r\n<li>Usability Testing</li>\r\n<li>Behavior Analysis</li>\r\n<li>Data Visualization</li>\r\n<li>Interaction Design</li>\r\n<li>Systematic Design</li>\r\n<li>Information Architecture</li>\r\n<li>Technical or Copy Writing</li>\r\n<li>Accessibility</li>\r\n<li>Experience with the Joomla platform is preferred but not necessary. All candidates should have knowledge of web and mobile technologies and experience with internet, graphic or UX design software.</li>\r\n</ul>\r\n<p>2017 promises to be a big year for the Joomla platform and you can be part of it. If you are interested in contributing to the JUX Team please fill out the application below.</p>\r\n<p><span style="text-decoration: underline; font-kerning: none;"><strong><a href="http://goo.gl/forms/uwhj4bmzMv">JUX Team Member Application</a></strong></span></p>', '', '2015-10-01', '2017-12-07', 1, 0, 15, 430, '2014-11-08 22:08:35', 447, '2018-01-04 15:40:20', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(40, 0, 'Web Services Working Group', 'web-services-working-group', 0, 51, 'WSWG', '<p>For further information see Web Services Working Group Page.</p>', '', 'https://docs.joomla.org/Web_Services_Working_Group', '<p>The Webservices working group has a channel on Glip (<a href="https://glip.com/">https://glip.com/</a>). Please contact me on coolbung [at] gmail.com to get yourself added to the Glip chat.</p>', '', '2012-05-08', '2016-12-29', 1, 0, 1, 430, '2014-11-08 22:08:50', 669, '2016-12-29 22:09:16', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(43, 0, 'Joomla Turns 10', 'joomla-turns-10', 0, 53, '', 'This working group organizes the special activities around in 2015, when Joomla turns 10.', '', '', '<h3>Looking for Team members &amp; Team lead</h3>\r\n<p>This working group will be tasked with the organization of all special activities around the 10th Birthday of Joomla in 2015. Do you have great ideas about how to make this unforgettable? We\'re looking for you!</p>\r\n<p>Please contact Sander Potjer if you are interested in joining this temporary working group</p>', '', '2014-11-09', '2015-09-30', 1, 0, 1, 430, '2014-11-09 00:00:00', 430, '2016-08-26 18:49:00', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(44, 0, 'Extensions Directory Team', 'extensions-directory-team', 1, 55, 'JED', '<p>The Joomla Extensions Directory (JED) is the website where Joomla users can find free and paid extensions for Joomla.</p>', 'mark.fleeson@community.joomla.org', 'https://extensions.joomla.org', '<p>If you find any bugs or would like to suggest an improvement, please find the issue on our <a href="https://github.com/joomla/jed-issues/issues">Github Issue Tracker. </a></p>\r\n<ul>\r\n<li><a href="https://extensions.joomla.org/blog/item/fun-in-jed-bug-smashing-and-feature-development/">Fun in JED: bug smashing and feature development [Updated]</a></li>\r\n<li><a href="https://extensions.joomla.org/support/knowledgebase/item/contributing-code-to-the-jed/">Contributing Code to the JED</a></li>\r\n</ul>\r\n<p>Your opinion could make a significant impact on the Extensions Directory.</p>\r\n<p>If you are interested to collaborate with the JED Team, <strong>processing extensions or developing new features</strong>. Please, contact us here:&nbsp;<a href="teams/extensions-directory-team">https://volunteers.joomla.org/teams/extensions-directory-team#contact</a></p>', 'ds', '2014-12-20', '0000-00-00', 1, 0, 13, 430, '2014-11-03 00:00:00', 6988, '2022-12-06 11:56:08', 0, '0000-00-00 00:00:00', '2016-12-02 11:57:45'),
	(45, 0, 'Capital Team', 'capital-team', 1, 55, '', '<p>The Capital Team manages all business level partnerships and financial sponsorships of the Joomla Project as well as the banner advertising on our web sites.</p>', '', '', '<p>The Capital Team is looking for volunteers with all sorts of fund raising related skills:</p>\r\n<ul>\r\n<li>web development</li>\r\n<li>marketing</li>\r\n<li>promotion</li>\r\n<li>sales</li>\r\n<li>graphic design</li>\r\n<li>writing</li>\r\n<li>ecommerce</li>\r\n</ul>\r\n<p>If you would like to volunteer to work with the Capital Team in any capacity send an email along with any related relevant information about your interest to <a href="mailto:mike.demopoulos@opensourcematters.org?subject=Capital%20Team">mike.demopoulos@opensourcematters.org</a></p>', '', '0000-00-00', '0000-00-00', 1, 0, 4, 430, '2014-11-12 22:31:16', 669, '2022-03-29 20:50:52', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(46, 0, 'Joomla! Event Traveller Programme Team', 'event-traveller-programme-team', 2, 56, 'JET', '<p>The JET Programme is an initiative that was created to support active project volunteers and community members who have dedicated time and energy to make Joomla better; and who would like to attend larger Joomla events, such as J and Beyond and the Joomla! World Conference.</p>', '', '', '<p>We are currently not looking for new volunteers &nbsp; &nbsp;</p>', '', '0000-00-00', '2022-02-17', 1, 0, 7, 430, '2014-11-16 00:00:00', 2198, '2022-02-17 22:12:37', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(47, 7, 'SWOT Analysis Team', 'swot-analysis-team', 0, 53, '', 'The SWOT Team is a sub-team of, and reports to, the Marketing Working Group.  There have been several "Strengths-Weaknesses-Opportunities-Threats" projects over the years.  The latest one was launched by Chris Nielsen in January 2014 and it presented it\'s top-level findings in October, 2014.  The team is discussing continuing with product-level analysis in 2015.  This cross-functional team includes members of the Marketing Working Group plus representatives from other leadership teams and working groups.', '', '', '', '', '2014-01-16', '2015-12-31', 1, 0, 2, 430, '2014-11-17 20:59:30', 485, '2016-09-01 12:07:37', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(48, 0, 'Framework Branding and Marketing Team', 'framework-branding-and-marketing-team', 0, 53, '', '', '', '', '', '', '2013-11-01', '2014-01-01', 1, 0, 0, 430, '2014-11-17 21:07:56', 0, '0000-00-00 00:00:00', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(49, 4, 'Revista de la comunidad Joomla!', 'revista-de-la-comunidad-joomla', 0, 55, 'JCMÃ‘', '<p>La Revista de la Comunidad Joomla!â„¢ es la versiÃ³n en espaÃ±ol de la Joomla! Community Magazineâ„¢. Es una publicaciÃ³n mensual con contenidos independientes, 100% en espaÃ±ol para la comunidad de habla hispana.</p>', '', '', '<p>Siempre necesitamos colaboradores para la Revista de la Comunidad Joomla!â„¢. Puedes unirte a nuestro equipo como un colaborador frecuente, escribiendo un artÃ­culo mensual para la Revista o como traductor de artÃ­culos de la ediciÃ³n en inglÃ©s, adaptÃ¡ndolos al espaÃ±ol. La Esfera Joomla! estÃ¡ llena de contenidos para traspasar a nuestros lectores a travÃ©s de un artÃ­culo. Sabemos que tienes mucho que contar y hay una enorme comunidad con ganas de leerte. Â¡Te esperamos!. Ante cualquier duda o consulta, no dudes en enviar un correo a:</p>\r\n<p><a href="mailto:alejandro.pascoli@community.joomla.org">alejandro.pascoli@community.joomla.org</a><a href="mailto:alejandro.pascoli@community.joomla.org"></a></p>\r\n<p><a href="mailto:andrea.kekan-garcia@community.joomla.org" target="_blank">andrea.kekan-garcia@community.joomla.org</a></p>', '', '2013-05-01', '2019-12-31', 1, 0, 5, 430, '2014-11-21 14:13:54', 2198, '2020-05-18 07:53:19', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(50, 0, 'CMS Maintenance Team', 'cms-maintenance-team', 1, 51, '', '<p>This team is responsible for reviewing all patches submitted to the Joomla! CMS, merging patches into the code base, and ensuring that the high standards of Joomla are maintained at all times.</p>', '', 'https://github.com/joomla/joomla-cms', '', '', '2015-01-01', '0000-00-00', 1, 0, 4, 430, '2014-11-25 00:00:00', 669, '2019-08-03 16:12:30', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(51, 0, 'CMS Release Team', 'cms-release-team', 1, 51, '', '<p>This team is responsible for coordinating all aspects of Joomla! CMS releases. Also, one main task is to test CMS release candidates extensively on complex testing environments.</p>', '', '', '<p>Contact Sigrid Gramlinger on Glip or at&nbsp;<a href="mailto:sigrid.gramlinger@community.joomla.org">sigrid.gramlinger@community.joomla.org</a></p>\r\n<p>You want to know, how to test? at this page you will find <strong>release dates</strong> and some <strong>tipps</strong>:<br /><a href="https://docs.joomla.org/Pre-Release_Testing">https://docs.joomla.org/Pre-Release_Testing</a></p>\r\n<p>Here you can download the latest releases (including release candidates = RC):<br /><a href="https://github.com/joomla/joomla-cms/releases">https://github.com/joomla/joomla-cms/releases</a></p>\r\n<p>And here you find the latest milestones on github for releases, so you can filter on merged PRs:<br /><a href="https://github.com/joomla/joomla-cms/milestones">https://github.com/joomla/joomla-cms/milestones</a></p>\r\n<p>If you find a bug or issue - please find details here - everything supports us!<br /><a href="https://docs.joomla.org/Filing_bugs_and_issues">https://docs.joomla.org/Filing_bugs_and_issues</a></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '', '2016-10-01', '0000-00-00', 1, 0, 6, 430, '2014-11-25 20:49:03', 1036, '2022-06-13 20:16:48', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(52, 0, 'Structure Team ', 'structure-team', 0, 52, '', '<p>The Structure Team is elected from members from the 3 Leadership Team and has worked since J &amp; Beyond 2014 on creating a new structure for Joomla and the organization behind Open Source Matters.</p>', '', '', '', '', '2014-05-30', '2015-10-02', 1, 0, 2, 430, '2014-12-03 21:51:21', 1035, '2017-03-22 14:17:36', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(53, 28, 'en-GB User Interface Text Team', 'user-interface-text-working-group', 1, 51, '', '<p>The official language of Joomla is en-GB and yet the actual strings we use have been created, over 10 years, many by people who are not native en-GB speakers. Establish official style guidelines for writing en-GB strings. Ensure consistency throughout Joomla. Provide translation teams with an easy framework and guidelines to create their own style guides. The style guide is a living document that may be updated and added to over time as the need arises. The style guide will be maintained by native en-GB speakers.</p>', 'hugh.douglas-smith@extensions.joomla.org', 'https://developer.joomla.org/en-gb-user-interface-text-guidelines.html', '<p>Any native en-GB speaker is welcome to join the group. No technical skills are required just the willingness to contribute.</p>', '', '2015-01-04', '0000-00-00', 1, 0, 7, 430, '2015-01-05 00:00:00', 447, '2017-07-05 19:45:44', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(54, 13, 'JUG Directory Working Group', 'jug-directory-working-group', 0, 54, '', '<p>The JUG Directory Working Group is tasked with developing the new JUG directory, which will feature on community.joomla.org. The directory is a core part of our community, allowing people to find local like-minded Joomlers to meet up with, share their knowledge and passion for Joomla, and learn more from each other. The current directory has been in existence for some time, and is no longer fit for purpose. This team will review the project briefs from the JUG team and the wider JUG Organiser community, with a view to planning, designing, developing and implementing a new JUG Directory.</p>', '', '', '<p>To get involved please email <a href="mailto:ruth.cheesley@community.joomla.org">ruth.cheesley@community.joomla.org</a>&nbsp;with an overview of your skillset and your availability. &nbsp;Please also advise of your timezone and languages spoken.</p>\r\n<p>We require the following skills:</p>\r\n<ul>\r\n<li>Developer</li>\r\n<li>Designer</li>\r\n<li>UI/UX</li>\r\n</ul>\r\n<p>We have a team set up on Glip which you can join, also!</p>', '', '2015-02-11', '2016-06-01', 1, 0, 5, 430, '2015-02-12 06:50:04', 1035, '2017-02-14 14:33:53', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(55, 14, 'Vulnerable Extensions List API Team', 'vulnerable-extensions-list-api-team', 0, 55, 'VEL', '', '', 'https://vel.joomla.org', '<p>Refer to <a href="http://magazine.joomla.org/issues/issue-may-2015/item/2704-vel-programming-volunteers-neededhttp://magazine.joomla.org/issues/issue-may-2015/item/2704-vel-programming-volunteers-needed">vel programming volunteers needed</a><br /><br />Please contact one of the members of the team listed who will provide a link to the ideas document.</p>', '', '0000-00-00', '2016-11-19', 1, 0, 3, 430, '2015-02-16 00:00:00', 568, '2016-11-19 00:22:50', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(56, 0, 'Accessible admin template working group', 'accessible-admin-template-working-group', 0, 51, '', 'These are the brave souls that are looking at designing, developing and implementing the new admin Joomla! template. This new template will have improved usability, will meet accessibility standards and be the main admin template for all Joomla! users.', '', '', '<p>We have quite a few team members now including our new team lead, designers and a few developers.</p>\r\n<p>What we will need help with is more accessibility testing and development. If you have the skills and expertise, please contact us.</p>\r\n<p>Please send a request to&nbsp;<a href="mailto:peter.bui@community.joomla.org">peter.bui@community.joomla.org</a>&nbsp;or&nbsp;<a href="mailto:jessica.dunbar@community.joomla.org">jessica.dunbar@community.joomla.org</a>&nbsp;to be added to Glip if you don\'t have an account already.</p>\r\n<p>Reports and progress will be published via the Volunteers portal.</p>', '', '2015-03-17', '2015-08-07', 1, 0, 0, 430, '2015-03-17 00:00:00', 430, '2015-08-07 12:56:31', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(57, 0, 'Joomla Accessibility Team', 'accessibility-team', 1, 51, 'JAT', '<h2 dir="ltr">Inclusion</h2>\r\n<p dir="ltr">Joomla translates to All Together, and this feeling of unity is one of our core beliefs. Inclusion is in our heart, and as a community, we do our best to accept and welcome everyone. Accessibility is the study and practice of how to best include people, regardless of technology or ability.</p>\r\n<h2 dir="ltr">Our mission</h2>\r\n<p dir="ltr">Our main goal is to make all the Joomla Properties, the CMS, Framework and Portal, compliant with the WCAG 2.1 AA standard, a set of rules that make sure all aspects of a website or platform is Accessible for people with disabilities.</p>\r\n<p dir="ltr">Beyond that, we will mobilize and work with extension and template providers to make all parts of the Joomla ecosystem accessible. By providing the CMS and Framework as a fully accessible foundation, as well as providing tools and information for the standards and processes, we hope to make Joomla, as a whole, a beacon for accessibility in the world.</p>', '', 'https://docs.joomla.org/Portal:Accessibility', '<p>With the aim to make Joomla! completely accessible inside and out, we need your help.</p>\r\n<p>Please send a request to accessibility@community.joomla.org to be added to Glip if you don\'t have an account already.</p>\r\n<p>Reports and progress will be published via the Volunteers portal.</p>', '', '2015-03-17', '0000-00-00', 1, 0, 21, 430, '2015-03-17 00:00:00', 2591, '2019-02-07 11:45:19', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(58, 0, 'Conflict Resolution Team', 'conflict-resolution-team', 2, 52, '', '', '', '', '', '', '2014-11-08', '0000-00-00', 1, 0, 3, 430, '2015-05-17 17:20:01', 1035, '2017-03-22 14:11:00', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(59, 0, 'Joomla X Team', 'joomla-x-working-group', 2, 51, 'JXWG', '<p>Joomla! X Working Groups umbrella. Voluntary but not without responsibilities and consequences. The Joomla! X Working Group is dedicated to people contributing to making a minimal viable product for Joomla! X that will be the best contemporary CMS with a cutting edge architecture and one of a kind user experience</p>', '', '', '<p>Anybody able and willing to get her/his hands dirty to make J4 the best should <br />Contact Marco Dings on glip</p>', '', '2015-05-30', '2019-03-21', 1, 0, 7, 430, '2015-06-08 08:56:20', 547, '2019-04-04 16:07:22', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(60, 59, 'Joomla X Architecture', 'joomla-x-architecture', 1, 51, '', '<p>Part of the Joomla! X working groups, responsible for the architecture for Joomla! X</p>', '', '', '', '', '0000-00-00', '2019-03-08', 1, 0, 5, 430, '2015-06-16 11:44:57', 669, '2019-06-08 16:27:18', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(61, 0, 'Legal Working Group', 'legal-working-group', 2, 52, '', '<p>Joomla! is the worlds 2nd largest Content Management System. The Joomla software is purely Open Source (GPL v2.0) created by volunteers from around the world. As an all-volunteer non-profit organization, Joomla is managed through working groups staffed by members of the Joomla Community.</p>\r\n<p>The Legal Working Group is tasked with helping the Board sustain the legal health of the project. This includes licensing of the business and the software, deal making and contracting, risk management and resolving claims and disputes. While the tasks are infrequent, when we have issues we need a variety of resources from business people that can help negotiate and review contracts, to volunteers with legal training that provide assistance in minimizing our formal legal costs, particularly in countries other than the U.S..</p>\r\n<p>This working group is organized in two sub-teams. One being Contributors located around the world that will be on-call to assist us with document translations and learning about local business customs and regulations. The other sub-team are Members that are willing to meet regularly and devote hours each month to actively participating in forming legal relationships, contracting and monitoring legal compliance.</p>', 'treasurer@opensourcematters.org', 'https://opensourcematters.org', '<p>We are actively seeking both lawyers and business people with a background in law, business contracting, and/or open source software licensing who would like to volunteer to help a thriving global community. (Bar membership / license to practice is NOT required.)</p>\r\n<p>Being multi-lingual and able to help us with legal notice and document translation is a plus. We offer a great community with knowledge and experience about implementing and enforcing Open Source licenses and with unique opportunities to benefit millions of CMS users around the world (and at the same time enhance your resume.)</p>\r\n<p>To learn more or to apply for group membership, please email <a href="mailto:LegalWG@opensourcematters.org" target="_blank" rel="noreferrer">LegalWG@opensourcematters.org</a> and include some background information, a profile of your knowledge areas and how you would like to be involved with this group.</p>', '', '2015-09-30', '2022-02-17', 1, 0, 7, 430, '2015-09-30 18:17:36', 2198, '2022-02-17 22:07:22', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(62, 0, 'Transition Team', 'transition-team', 0, 52, '', '', '', '', '', '', '2015-10-01', '2017-04-20', 1, 0, 2, 430, '2015-09-30 18:20:02', 488, '2017-04-24 08:39:49', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(63, 5, 'Developer Conference Team', 'developer-conference-team', 0, 54, '', '', '', '', '', '', '2015-11-06', '2017-12-01', 1, 0, 4, 430, '2015-11-06 06:27:54', 2198, '2020-06-25 11:44:23', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(64, 5, 'African Joomla Conference', 'african-joomla-conference', 0, 54, '', '', '', '', '', '', '2015-11-10', '2018-10-18', 1, 0, 4, 430, '2015-11-10 09:56:07', 468, '2018-10-18 17:43:56', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(65, 40, 'Mobile Apps Team', 'mobile-apps-team', 0, 51, '', '<p>The Mobile Apps working group is dedicated to people contributing to support mobile web-enabled and native applications for Joomla that will be the best "mobile-first" CMS.</p>', '', '', '', '', '2015-11-13', '2016-12-30', 1, 0, 2, 430, '2015-11-13 13:22:42', 669, '2020-06-21 16:48:07', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(66, 13, 'JUG Outreach Team', 'jug-outreach-team', 0, 54, '', '', '', '', '', '', '2015-12-17', '2016-02-22', 0, 0, 6, 430, '2015-12-17 17:55:38', 430, '2016-11-07 19:53:12', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(67, 7, 'Joomla.org homepage redesign', 'joomlaorg-homepage-redesign', 0, 3, '', '<p>We are re-designing the front page of Joomla.org</p>', '', '', '<p>We are not currently looking for volunteers.</p>', '', '2015-08-05', '2017-02-13', 1, 0, 4, 430, '2016-01-22 08:38:26', 488, '2017-02-12 23:32:19', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(68, 0, 'Joomla! Optimisation Team', 'seo-team', 2, 59, 'JOT', '<p>The tasks of the Joomla!-SEO (alias: JOT) team are:</p>\r\n<ul>\r\n<li>to support the Joomla! project in ensuring that the official websites we own and manage are properly optimised<br /><br /></li>\r\n<li>to assist with identifying existing problems and developing strategies for addressing them<br /><br /></li>\r\n<li>to monitor relevant SEO metrics<br /><br /></li>\r\n<li>to support teams with planning new web-based projects, migrations and campaigns<br /><br /></li>\r\n<li>to provide guidance in SEO-related matters relevant to the Joomla! CMS and its properties</li>\r\n</ul>', 'seo-team@community.joomla.org', '', '<p>If you would be interested in getting involved with the team, please email <a href="mailto:seo-team@community.joomla.org">seo-team@community.joomla.org</a>&nbsp;with an outline of your interests, expertise and time available. &nbsp;</p>\r\n<p>Thank you!</p>', '', '2016-04-20', '0000-00-00', 1, 0, 14, 430, '2016-04-20 10:09:29', 669, '2022-03-29 20:52:34', 0, '0000-00-00 00:00:00', '2017-01-23 14:33:28'),
	(69, 24, 'GSoC 16 Recording action logs', 'gsoc-action-logs', 0, 51, '', '<p>This GSoC project is about making a Joomla! CMS extension to store the tasks performed by any user, informing those who did, where did when did and what made within the project. The project has two main parts: capturing the log data and viewing the captured data. It will be a package that contains a plugin to store events and a component to view, filter and control them.</p>', '', '', '', '', '2016-05-04', '2016-12-29', 1, 0, 2, 497, '2016-06-04 19:10:24', 525, '2016-12-30 09:14:52', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(70, 24, 'GSoC 16 Improved multi-lingual content management', 'gsoc-multi-lingual', 0, 51, '', '<p>The goal of the project is to improve a multi-lingual site\'s back-end, meaning that besides having several content (articles, menu items, categories, contacts, etc.) separated by default, one can associate content languages with those items side-by-side to avoid tedious replication tasks of going back and forth to apply changes.</p>', '', '', '', '', '2016-06-04', '2016-12-29', 1, 0, 2, 497, '2016-06-04 19:43:03', 525, '2016-12-30 09:13:56', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(71, 24, 'GSoC 16 Browser automated tests', 'gsoc-browser-tests', 0, 51, '', '<p>This project is working on improving the automated tests for Joomla CMS</p>', '', '', '', '', '2016-06-04', '2016-12-29', 1, 0, 2, 497, '2016-06-04 19:48:44', 525, '2016-12-30 09:12:57', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(72, 24, 'GSoC 16 Improving the menu item workflow', 'gsoc-menu-workflow', 0, 51, '', '<p>This Joomla GSoC project aims to improve the workflow regarding creating articles &amp; menu buttons to those articles. In Joomla 1.0 it was possible in the administrator back-end to create a menu link to an article from within the article edit view</p>', '', '', '', '', '2016-01-11', '2016-12-29', 1, 0, 2, 497, '2016-06-04 19:52:26', 525, '2016-12-30 09:14:19', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(73, 24, 'GSoC 16 Sharable draft content', 'gsoc-draft-content', 0, 51, '', '<p>This project\'s aim is to enable draft sharing using Joomla! by making use of sharable link (such as those in Google Drive/Dropbox). Anyone having this link would be able to view the draft in a new UI. This new feature would work as an extension to 3.x versions of Joomla.</p>', '', '', '', '', '2016-06-04', '2016-12-29', 1, 0, 2, 497, '2016-06-04 19:56:06', 525, '2016-12-30 09:15:06', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(74, 24, 'GSoC 16 JavaScript Tests', 'gsoc-javascript-tests', 0, 51, '', '<p>Since the Joomla core is written primarily in PHP the codebase currently has a comprehensive test coverage for PHP so far. What the codebase lacks is such a comprehensive test coverage for the collection of custom written JavaScript libraries. The project targets at introducing unit testing for those custom JavaScript libraries and automating the tests to run on Travis build triggered by a PR to the Github repository.</p>', '', '', '', '', '2016-06-04', '2016-12-29', 1, 0, 2, 497, '2016-06-04 20:00:40', 525, '2016-12-30 09:14:35', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(75, 28, 'Documentation Helpscreen Team', 'documentation-helpscreen-team', 1, 51, 'JDocs', '<p>The Documentation Helpscreen Team is a sub-team of the official Joomla! Documentationâ„¢ Working Group. The aim of this sub-team is to update and maintain the help screens, in order to reflect the latest version of Joomla. As soon as Help Screens are updated, they will be marked for translation to be available for most.</p>', 'sandra.thevenet@community.joomla.org', 'https://docs.joomla.org/JDOC:Documentation_Helpscreen_Team', '<p>All <a href="https://docs.joomla.org/Special:MyLanguage/Help_screens" title="Special:MyLanguage/Help screens">Help Screen</a> pages are created and served to every Joomla! Installation worldwide from this wiki! They are necessary for beginners and even those with intermediate knowledge of Joomla!<br />The team is looking for volunteers willing to help updating the 3.7 Help Screens as well as working on the creation of Joomla! 4 Help Screens.</p>\r\n<p>Please see: <a href="https://docs.joomla.org/JDOC:How_to_Contribute_to_Joomla!_Documentation#Help_Screens">How to contribute to the Help Screens Project</a> and don\'t hesitate to join us.</p>', '', '2016-06-04', '0000-00-00', 1, 0, 5, 497, '2016-06-04 00:00:00', 447, '2017-07-05 19:45:30', 0, '0000-00-00 00:00:00', '2016-12-01 20:52:24'),
	(77, 0, 'Community Translation Team', 'community-translation-team', 1, 53, '', '<p>The Community Translation Team is responsible for the localisation needed within The Joomla! Project, for sites, announcements, marketing, official extensions etc. You can find all the localised Joomla\'s Projects <a href="https://crowdin.com/projects/Joomla" title="Localised Joomla\'s Projects on Crowdin">here</a> and follow the team on <a href="https://twitter.com/JoomlaL10nC" target="_blank" rel="noopener noreferrer" title="Joomla! Translation Centre">Twitter</a></p>', 'mike.brandner@community.joomla.org', '', '', '', '2016-09-20', '2021-03-01', 1, 1, 11, 430, '2016-09-20 20:43:46', 2198, '2021-03-08 20:48:44', 0, '0000-00-00 00:00:00', '2016-11-21 07:40:58'),
	(78, 0, 'Certification Team', 'certification-team', 1, 59, 'JCP', '<p>The Joomla! Certification Program Team is made up of Joomlers working on Operations and Marketing, or the Certification Platform and exams.<br /><br />Operations and Marketing volunteers: connect with interested trainers, Joomla! Learning Partners (JLP), JoomlaDays, Joomla! User Groups (JUGs) and Exam Supervisors. In addition to supporting the Joomla! Certification Program with marketing and communication, we answer questions about the certification process, and by providing contracts for exam hosts. We welcome open dialogue with the community to get feedback on the Joomla! Certification.<br /><br />Platform and Exam volunteers: are responsible for the various Joomla! certification exams, starting with defining knowledge areas for each exam, creating questions and answers for these exams in English, and coordinating the translation of the exams into the various different languages.&nbsp; We are also responsible for maintaining the certification platform, which consists of Exam Delivery, Learning Partners Dashboard, Payments, Enrollment and maintaining the directory of Certified Users. We monitor the exam results and update the questions and/or answers and handle the feedback from exam candidates.</p>\r\n<p><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"></span>For more information over the <a href="https://certification.joomla.org/">Joomla Certification Program</a>&nbsp;</p>', 'certification@community.joomla.org', 'https://certification.joomla.org', '<p>There are many ways you can contribute to the Joomla! Certification Operations &amp; Marketing Team. Start by visiting our permanent call for volunteers at <a href="https://certification.joomla.org/contribute/volunteer">https://certification.joomla.org/contribute/volunteer</a> where you can choose one of the areas you would like to be involved.<br /><br /><strong>Certification Ambassadors</strong><br /><br />Certification Ambassadors are "facilitators", serving as link between the partner network (JLPs, JUG &amp; JoomlaDays organisers) and the Certification Operations Team. If you would like to contribute as Certification Ambassador in your region, when you fill out the volunteer form, indicate Ambassador as your preference under â€œHow would you like to participate?â€<br /><br /><strong>Certification Platform &amp; Exams</strong><br />We are looking for:</p>\r\n<ul>\r\n<li><span style="text-decoration: underline;">Platform and Exam core members:</span> to coordinate Exam Team activities and to write and review questions and/or to maintain and develop the exam platform</li>\r\n<li><span style="text-decoration: underline;">Translators:</span> to translate exams into other common languages (currently Italian, French, German, Polish, Spanish and Dutch)</li>\r\n<li><span style="text-decoration: underline;">Developers:</span> to create the Developer Exam, extensions and do other development work.</li>\r\n</ul>\r\n<p>We are looking for people with these skills:</p>\r\n<ul>\r\n<li>Willing to be involved long term, at least one year (not compulsory for translators)</li>\r\n<li>Knowledgeable and experienced in the relevant exam subject (Administrator, Developer)</li>\r\n<li>Have passed the relevant certification exam or are willing to pass it.</li>\r\n<li>Be generally available for weekly team meetings and/or other forms of contact</li>\r\n<li>To be able to communcate in English: reading / writing and speaking at least as a second language level</li>\r\n<li>Have a lot of staying power and patience because for us quality goes before quantity</li>\r\n<li>Team spirit</li>\r\n<li>Not a Joomla! Learning Partner (JLP). We\'re sorry, this couild possibly cause a conflict of interest.</li>\r\n</ul>\r\n<p>If you want to help, please apply through our form.</p>\r\n<p>A permanent call for volunteers is open at <a href="https://certification.joomla.org/contribute/volunteer">https://certification.joomla.org/contribute/volunteer</a></p>', '', '2014-01-01', '0000-00-00', 1, 2, 29, 430, '2016-09-24 19:54:58', 2198, '2022-02-17 23:26:27', 0, '0000-00-00 00:00:00', '2016-11-09 14:36:11'),
	(79, 15, 'New Project Wide Template Design Team', 'new-project-wide-template-design-team', 2, 55, '', '<p>Continuing the work started by the <a href="teams/joomlaorg-homepage-redesign">Homepage Redesign Team</a>, we will be redesigning the Joomla.org site template, refreshing our web presence.</p>', '', '', '', NULL, '2016-10-09', '2018-12-31', 1, 3, 6, 447, '2016-10-09 17:09:49', 447, '2019-05-23 13:51:12', 0, '0000-00-00 00:00:00', '2016-11-10 16:34:44'),
	(80, 0, 'New Media Manager Team', 'new-media-manager-team', 2, 51, 'NMM', '<p>The mission of this team is to improve the existing media manager with modern technologies and new features.</p>', '', 'https://github.com/joomla-projects/media-manager-improvement', '', '', '2016-11-28', '2019-06-19', 1, 4, 8, 497, '2016-12-22 15:06:10', 547, '2019-06-19 07:49:59', 0, '0000-00-00 00:00:00', '2016-12-22 15:04:00'),
	(81, 7, 'Marketing Design Group', 'marketing-design-group', 2, 53, '', '<p>The Design Group is made up of individuals who have experience creating both online and print graphics, esp. as it relates to communications and marketing.</p>\r\n<p>Individual Marketing Groups are made up of&nbsp;people who share a common skillset or interest (i.e. Design, Copywriting, Video, Events, etc.). Members of the Marketing Team CAN be members of multiple groups, but should have a &lsquo;primary&rsquo; group.</p>', 'marketing@community.joomla.org', '', '<p>Use the contact form and indicate you would like to join the Design Group.</p>', NULL, '2017-01-21', '0000-00-00', 1, 5, 8, 462, '2017-01-21 10:52:09', 885, '2017-04-22 17:30:33', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(82, 7, 'Marketing Product Release Management Team', 'product-release-marketing-team', 2, 53, '', '<p>The Product Release Marketing Team is in charge of creating materials to promote Joomla! releases: imagery, landing page, translations, social media campaigns ...</p>', 'sandra.thevenet@community.joomla.org', '', '<p>The Product Release Marketing Team is looking for volunteers to help with the promotion campaign for Joomla! 4. Whatever is your skill (imagery, documentation, design, copywriting, developer, marketer), we need you!&nbsp;<br />Don\'t hesitate to contact us at <a href="mailto:sandra.thevenet@community.joomla.org?subject=Apply%20to%20the%20Product%20Release%20Team">sandra.thevenet@community.joomla.org</a>!</p>', NULL, '2017-01-21', '2018-04-27', 1, 6, 10, 462, '2017-01-21 10:52:58', 530, '2018-04-27 05:16:41', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(83, 59, 'Joomla 4 Working Group', 'joomla-4-working-group', 2, 51, '', '', '', '', '', '', '2017-01-24', '2019-03-21', 1, 7, 5, 430, '2017-01-24 12:01:24', 430, '2020-03-27 12:22:56', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(84, 34, 'Unit Testing Working Group', 'unit-testing-working-group', 1, 51, '', '<p>Joomla! Unit Testing Group</p>', 'yves.hoppe@community.joomla.org', 'https://joomla.org', '<p>Please contact: Yves Hoppe or Robert Deutz</p>', NULL, '2017-02-02', '2019-03-06', 1, 8, 3, 1041, '2017-02-02 18:42:32', 1041, '2019-03-07 08:27:02', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
