	(90, 39, 'JUX Resource Management', 'jux-resource-management', 0, 51, '', '<p><span id="docs-internal-guid-655760e6-118e-41ef-0a8c-058f41bbe23d"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; vertical-align: baseline; white-space: pre-wrap;">Responsible for managing JUX team resources and optimizing team processes. Evaluates existing team resources and develops strategies to maximize team resources.</span></span></p>\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; vertical-align: baseline; white-space: pre-wrap;">Team Responsibilities</span></p>\r\n<ul style="margin-top: 0pt; margin-bottom: 0pt;">\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; vertical-align: baseline; white-space: pre-wrap;">Manages contributor applications </span></p>\r\n</li>\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; vertical-align: baseline; white-space: pre-wrap;">Manages contributor onboarding process</span></p>\r\n</li>\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; vertical-align: baseline; white-space: pre-wrap;">Manages list of team contributor information and availability</span></p>\r\n</li>\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; vertical-align: baseline; white-space: pre-wrap;">Manages research volunteer list</span></p>\r\n</li>\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; vertical-align: baseline;">\r\n<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; vertical-align: baseline; white-space: pre-wrap;">Team resource auditing, evaluations and recommendations</span></p>\r\n</li>\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; vertical-align: baseline;"><span style="font-size: 11pt; vertical-align: baseline; white-space: pre-wrap;">Team budget and schedule management</span></li>\r\n</ul>', '', '', '', NULL, '2017-03-27', '2017-08-10', 1, 14, 3, 673, '2017-03-27 21:02:40', 2075, '2017-08-11 17:14:50', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(91, 39, 'JUX Research & Testing', 'jux-research-testing', 0, 51, '', '<p><span id="docs-internal-guid-655760e6-1194-87ad-82f0-6449b78fa152"><span style="font-size: 11pt; font-family: Arial; color: #000000; vertical-align: baseline; white-space: pre-wrap;">Responsible for the organization and Management of JUX user research &amp; testing efforts. The JUX Research &amp; Testing Team gathers user feedback and delivers analysis and recommendation reports to the community based on their findings.</span></span></p>\r\n<p dir="ltr" style="margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;"><span style="font-size: 11pt; font-family: Arial; color: #000000; font-weight: bold; vertical-align: baseline; white-space: pre-wrap;">Team Responsibilities</span></p>\r\n<ul style="margin-top: 0pt; margin-bottom: 0pt;">\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; vertical-align: baseline;">\r\n<p dir="ltr" style="margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;"><span style="font-size: 11pt; vertical-align: baseline; white-space: pre-wrap;">Create and manage research &amp; testing materials</span></p>\r\n</li>\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; vertical-align: baseline;">\r\n<p dir="ltr" style="margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;"><span style="font-size: 11pt; vertical-align: baseline; white-space: pre-wrap;">Creation and qualification of user personas</span></p>\r\n</li>\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; vertical-align: baseline;">\r\n<p dir="ltr" style="margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;"><span style="font-size: 11pt; vertical-align: baseline; white-space: pre-wrap;">Collection of user feedback and industry research</span></p>\r\n</li>\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; vertical-align: baseline;">\r\n<p dir="ltr" style="margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;"><span style="font-size: 11pt; vertical-align: baseline; white-space: pre-wrap;">Administration of user tests and interviews</span></p>\r\n</li>\r\n<li dir="ltr" style="list-style-type: disc; font-size: 11pt; font-family: Arial; color: #000000; vertical-align: baseline;">\r\n<p dir="ltr" style="margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;"><span style="font-size: 11pt; vertical-align: baseline; white-space: pre-wrap;">Analysis, reporting and recommendations</span></p>\r\n</li>\r\n</ul>', '', '', '', NULL, '2017-03-27', '2017-08-10', 1, 15, 2, 673, '2017-03-27 21:04:02', 2075, '2017-08-11 17:20:32', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(92, 39, 'JUX Design', 'jux-design', 0, 51, '', '<p><span style="color: #000000; font-family: Arial;"><span style="font-size: 14.6667px; white-space: pre-wrap;">Creates web and graphic designs for JUX projects, internal JUX team materials and team campaigns. Such as: prototypes, wireframes, mockups, infographics, presentations, team deliverables, templates for team materials and reports, team outreach and research materials. &nbsp; </span></span></p>\r\n<p><span style="color: #000000; font-family: Arial;"><span style="font-size: 14.6667px; white-space: pre-wrap;">Coordinates with production department teams and projects, as well as other community departments and working groups as necessary. &nbsp; </span></span></p>\r\n<p><strong><span style="color: #000000; font-family: Arial;"><span style="font-size: 14.6667px; white-space: pre-wrap;">Team Responsibilities</span></span></strong></p>\r\n<ul>\r\n<li>\r\n<p>Platform UI Design</p>\r\n</li>\r\n<li>\r\n<p>Wireframing, Mockups &amp; Prototyping</p>\r\n</li>\r\n<li>\r\n<p>Graphic Design for Team Materials</p>\r\n</li>\r\n<li>\r\n<p>Research &amp; Outreach Materials&nbsp;</p>\r\n</li>\r\n<li>\r\n<p>Data Visualization and research report designs</p>\r\n</li>\r\n<li>\r\n<p>Team Deliverable Designs &amp; Templates (Personas, User Flows, Task Grids etc)</p>\r\n</li>\r\n<li>\r\n<p>Team Presentations and Infographics</p>\r\n</li>\r\n<li>\r\n<p>General design related team tasks</p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>', '', '', '', NULL, '2017-03-27', '2017-08-10', 1, 16, 6, 673, '2017-03-27 21:06:06', 2075, '2017-08-11 17:19:47', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(93, 39, 'JUX Technical Team', 'jux-technical-team', 0, 51, '', '<p>Responsible for JUX technical and logistical tasks.&nbsp;</p>\r\n<p>Such as: maintaining and configuring JUX research platforms and testing installations, management of JUX Related Github issues, Technical writing and documentation, providing general assistance with development related team and project tasks.&nbsp;</p>\r\n<p><strong>Team Responsibilities</strong></p>\r\n<ul>\r\n<li>\r\n<p>Setup and maintenance of user research and testing platforms</p>\r\n</li>\r\n<li>\r\n<p>Setup and maintenance of team testing tools and testing environments</p>\r\n</li>\r\n<li>\r\n<p>Github issue and task management</p>\r\n</li>\r\n<li>\r\n<p>Development related team and project tasks</p>\r\n</li>\r\n<li>\r\n<p>Technical assistance for team members and contributors</p>\r\n</li>\r\n<li>\r\n<p>Technical Writing &amp; Documentation</p>\r\n</li>\r\n</ul>', '', '', '', NULL, '2017-03-27', '2017-08-10', 1, 17, 4, 673, '2017-03-27 21:11:46', 2075, '2017-08-11 17:19:07', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(94, 34, 'JavaScript Tests', 'javascript-tests', 1, 51, '', '<p>The JavaScript Test team is responsible for creating and maintaining the Joomla core CMS JavaScript tests based on Jasmine, Karma and Firefox. They are automatically run for every pull request / commit with Drone.</p>', '', '', '<p>You are familiar with JavaScript, Jasmine and Karma? We need your help to make the Joomla CMS tests even better!</p>', NULL, '2016-06-01', '2019-03-06', 1, 18, 3, 1041, '2017-04-02 12:51:55', 1041, '2019-03-07 08:25:38', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(95, 34, 'Docker and Infrastructure Team', 'docker-and-infrastructure-team', 1, 51, '', '<p>The docker team takes care of the Docker infrastructure we use for the Joomla automated testing.<br /><br />Keywords: Drone, Travis, Appveyor, Docker, Docker-Compose, Parallel testing</p>', '', '', '<p>You are familiar with Docker and continous integration solutions? We need your help! Get in contact with us!</p>', NULL, '2017-04-02', '2019-03-06', 1, 19, 3, 1041, '2017-04-02 12:57:26', 1041, '2019-03-07 08:26:21', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(96, 34, 'System Tests', 'system-tests', 1, 51, '', '<p>Browser based system tests with Codeception / Selenium for Joomla CMS.</p>', '', '', '<p>You are familiar or want to learn how to write system tests with Codeception? We are looking for new members! You can find us in the public Glip Channel "Testing &amp; CI General public Group" or send us an email to yves.hoppe [at] community.joomla.org</p>', NULL, '2017-04-02', '2019-03-06', 1, 20, 3, 1041, '2017-04-02 13:13:37', 1041, '2019-03-07 08:26:45', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(97, 7, 'Marketing Content Group', 'marketing-content-group', 0, 53, '', '<p>This is a group of all those that have skills/experience writing marketing copy (native/fluent English expected). This includes those with specific skills in writing for good SEO, writing for specific targets (i.e. Press Release Writers, etc.)</p>\r\n<p>Individual Marketing Groups are made up of&nbsp;people who share a common skillset or interest (i.e. Design, Copywriting, Video, Events, etc.). Members of the Marketing Team CAN be members of multiple groups, but should have a â€˜primaryâ€™ group.</p>', 'marketing@community.joomla.org', '', '<p>Use the Contact tab and indicate that you are interested in joining the Copywriting group.</p>', NULL, '2017-04-22', '2020-06-23', 1, 21, 5, 885, '2017-04-22 17:10:46', 6731, '2020-06-23 19:34:23', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(98, 7, 'Marketing Video Group', 'marketing-video-group', 0, 53, '', '<p>This is a group of individuals with skills in video editing, script writers, producers, live event producers/team members.</p>\r\n<p>Individual Marketing Groups are made up of&nbsp;people who share a common skillset or interest (i.e. Design, Copywriting, Video, Events, etc.). Members of the Marketing Team CAN be members of multiple groups, but should have a â€˜primaryâ€™ group.</p>', 'marketing@community.joomla.org', '', '<p>Use the Contact form here and indicate you are interested in being part of the Video Group.</p>', NULL, '2017-04-22', '2020-12-17', 1, 22, 2, 885, '2017-04-22 17:24:31', 6731, '2020-12-17 19:59:37', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(99, 7, 'Marketing Data Analysis & Metrics Group', 'marketing-data-analysis-metrics-group', 0, 53, '', '<p>The Data Analysis &amp; Metrics Group is made up of people with specific skills in gathereing, reporting and analyzing data in relation to marketing and online communications.</p>\r\n<p>Individual Marketing Groups are made up of&nbsp;people who share a common skillset or interest (i.e. Design, Copywriting, Video, Events, etc.). Members of the Marketing Team CAN be members of multiple groups, but should have a â€˜primaryâ€™ group.</p>', 'marketing@community.joomla.org', '', '<p>Use the contact form and indicate you would like to be part of the Data Analysis &amp; Metrics Group.</p>', NULL, '2017-04-22', '2017-06-07', 1, 23, 4, 885, '2017-04-22 17:27:01', 519, '2017-06-08 19:57:32', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(100, 7, 'Marketing Public Relations Management Team', 'marketing-public-relations-management-team', 0, 53, '', '<p>The Public Relations team is charged specifically with responding to communications from other sources (blog posts, articles, etc.) which address/mention Joomla!. This is a team that handles \'putting out fires\' or responding to invalid posts in a way that helps to improve the brand image of Joomla!</p>\r\n<p dir="ltr">A marketing sub-team is a set of people from different â€˜groupsâ€™ who come together to complete a specific one-time (or on-going) project. (On-going teams include â€˜Management Teamâ€™ in their title)</p>\r\n<p><span id="docs-internal-guid-e017f77b-96b7-eb74-a3a3-a77cced4300c">The team members are pulled from active contributors within existing marketing groups (based on the skills needed for the team).</span></p>', 'marketing@community.joomla.org', '', '<p>Join one of our Marketing Groups and we\'ll invite you to participate in teams that fit your skills and interests.</p>', NULL, '2017-04-22', '2017-06-07', 1, 24, 2, 885, '2017-04-22 17:42:02', 519, '2017-06-08 19:57:56', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(101, 7, 'The Joomla! Shop Management Team', 'joomla-store-management-team', 0, 53, '', '<p>The Joomla! Shop Mangement Team is charged with managing the operations of the online store as well as all physical products related to the Joomla! organization (marketing \'swag\', etc.)</p>\r\n<p>&nbsp;</p>\r\n<p>A marketing sub-team is a set of people from different â€˜groupsâ€™ who come together to complete a specific one-time (or on-going) project. (On-going teams include â€˜Management Teamâ€™ in their title)</p>\r\n<p>The team members are pulled from active contributors within existing marketing groups (based on the skills needed for the team).</p>', 'marketing@community.joomla.org', '', '<p>If you have specific experience in managing online stores of physical product (including international product production and order fulfilment) please use the contact form and indicate you would like to join the Joomla! Store Management Team.</p>', NULL, '2017-04-22', '2017-06-07', 1, 25, 3, 885, '2017-04-22 17:46:00', 519, '2017-06-08 19:56:53', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(102, 24, 'GSoC 17 Webservices ', 'gsoc-17-webservices', 1, 51, '', '<p>GSoC Project team for Webservices.&nbsp;</p>\r\n<p>Github Repo Available here:&nbsp;<span style="color: #1155cc; font-family: Arial; text-decoration-line: underline; white-space: pre-wrap;"><a href="https://github.com/joomla-projects/gsoc17_webservices">https://github.com/joomla-projects/gsoc17_webservices</a> </span></p>\r\n<p>Idea available here:&nbsp;<span style="color: #1155cc; font-family: Arial; text-decoration-line: underline; white-space: pre-wrap;"><a href="https://docs.joomla.org/GSOC_2017_Project_Ideas#Project_I:_Webservices_in_Joomla.21">https://docs.joomla.org/GSOC_2017_Project_Ideas#Project_I:_Webservices_in_Joomla.21</a></span></p>\r\n<p>&nbsp;</p>', 'gsoc@opensourcematters.org', '', '', NULL, '2017-05-04', '2017-12-05', 1, 26, 4, 525, '2017-05-04 09:15:52', 525, '2017-12-07 05:46:09', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(103, 24, 'GSoC 17 Improved Routing', 'gsoc-17-improved-routing', 1, 51, '', '<p>Project Team for GSoC 2017 Project for Improved Routing</p>\r\n<p>Github Repo Available Here:&nbsp;<span style="color: #1155cc; font-family: Arial; text-decoration-line: underline; white-space: pre-wrap;"><a href="https://github.com/joomla-projects/gsoc17_improved_routing">https://github.com/joomla-projects/gsoc17_improved_routing</a> </span></p>\r\n<p>Idea Information available Here:&nbsp;<span style="color: #1155cc; font-family: Arial; text-decoration-line: underline; white-space: pre-wrap;"><a href="https://docs.joomla.org/GSOC_2017_Project_Ideas#Project_II:_Improved_Routing">https://docs.joomla.org/GSOC_2017_Project_Ideas#Project_II:_Improved_Routing</a> </span></p>', 'gsoc@opensourcematters.org', '', '', NULL, '2017-05-04', '2017-12-05', 1, 27, 3, 525, '2017-05-04 09:25:05', 525, '2017-12-07 05:44:37', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(104, 24, 'GSoC 17 Media Manager', 'gsoc-17-media-manager', 0, 51, '', '<p>GSOC 2017 Media Manager Project</p>\r\n<p>&nbsp;</p>\r\n<p>Github Repo:&nbsp;</p>\r\n<p><span style="color: #1155cc; font-family: Arial; white-space: pre-wrap; text-decoration-line: underline;"><a href="https://github.com/joomla-projects/media-manager-improvement">https://github.com/joomla-projects/media-manager-improvement</a> </span></p>', '', '', '', NULL, '2017-05-05', '2017-12-05', 1, 28, 2, 525, '2017-05-05 06:10:44', 525, '2017-12-07 05:45:09', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(105, 24, 'GSoC 17 Parallel Testing', 'gsoc-17-parallel-testing', 1, 51, '', '<p>GSoC 17 Parallel Testing Team.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Github Link:&nbsp;<span style="color: #1155cc; font-family: Arial; text-decoration-line: underline; white-space: pre-wrap;"><a href="https://github.com/joomla-projects/gsoc17_parallel_testing">https://github.com/joomla-projects/gsoc17_parallel_testing</a> </span></p>', '', '', '', NULL, '2017-05-05', '2017-12-05', 1, 29, 3, 525, '2017-05-05 06:14:14', 525, '2017-12-07 05:45:22', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(106, 24, 'GSoC 17 Publishing Workflow', 'gsoc-17-publishing-workflow', 1, 51, '', '<p>GSoC 2017 Publishing Workflow Project Team</p>\r\n<p>&nbsp;</p>\r\n<p>Github Repo link:&nbsp;<span style="color: #1155cc; font-family: Arial; text-decoration-line: underline; white-space: pre-wrap;"><a href="https://github.com/joomla-projects/gsoc17_publishing_workflow">https://github.com/joomla-projects/gsoc17_publishing_workflow</a> </span></p>', '', '', '', NULL, '2017-05-05', '2017-12-05', 1, 30, 3, 525, '2017-05-05 06:25:01', 525, '2017-12-07 05:46:19', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(107, 24, 'GSoC 17 Expand Extension Manager', 'gsoc-17-expand-extension-manager', 1, 51, '', '<p>GSoC 2017 Project, Expand Extension Manager</p>\r\n<p>&nbsp;</p>\r\n<p>Github Repo Link:&nbsp;<span style="color: #1155cc; font-family: Arial; text-decoration-line: underline; white-space: pre-wrap;"><a href="https://github.com/joomla-projects/gsoc17_expand_extension_manager">https://github.com/joomla-projects/gsoc17_expand_extension_manager</a> </span></p>', '', '', '', NULL, '2017-05-05', '2017-12-05', 1, 31, 3, 525, '2017-05-05 06:30:18', 525, '2017-12-07 05:44:24', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(108, 24, 'GSoC 17 JS tests for Joomla 4', 'gsoc-17-js-tests-for-joomla-4', 1, 51, '', '<p>GSoC 2017 Project for&nbsp;JS tests for Joomla 4</p>\r\n<p>&nbsp;</p>\r\n<p>Github Link:&nbsp;<span style="color: #1155cc; font-family: Arial; text-decoration-line: underline; white-space: pre-wrap;"><a href="https://github.com/joomla-projects/gsoc17_js_tests">https://github.com/joomla-projects/gsoc17_js_tests</a><br /></span></p>', '', '', '', NULL, '2017-05-05', '2017-12-05', 1, 32, 3, 525, '2017-05-05 07:33:25', 525, '2017-12-07 05:44:48', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(109, 24, 'GSoC 17 Refactoring help screen on JDocs', 'gsoc-17-refactoring-help-screen-on-jdocs', 1, 51, '', '<p>GSoC 2017 Team for Project&nbsp;Refactoring help screen on JDocs</p>\r\n<p>&nbsp;</p>\r\n<p>Github Repo Link:&nbsp;<span style="color: #1155cc; font-family: Arial; text-decoration-line: underline; white-space: pre-wrap;"><a href="https://github.com/joomla-projects/gsoc17_helpscreens_on_jdocs">https://github.com/joomla-projects/gsoc17_helpscreens_on_jdocs</a> </span></p>', '', '', '', NULL, '2017-05-09', '2017-12-05', 1, 33, 3, 525, '2017-05-09 06:02:25', 525, '2017-12-07 05:46:00', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(110, 24, 'GSoC 17 PR testing Platform', 'gsoc-17-pr-testing-platform', 1, 51, '', '<p>GSoC 2017 Project team for&nbsp;PR testing Platform</p>\r\n<p>&nbsp;</p>\r\n<p>Github Repo Link:&nbsp;<span style="color: #1155cc; font-family: Arial; text-decoration-line: underline; white-space: pre-wrap;">https://github.com/joomla-projects/gsoc17_pr_testing_platform</span></p>', '', '', '', NULL, '2017-05-09', '2017-12-05', 1, 34, 3, 525, '2017-05-09 06:11:39', 525, '2017-12-07 05:45:32', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(111, 22, 'JWC - Sponsorship Team', 'jwc-sponsorship-team', 2, 54, '', '', '', '', '', NULL, '2017-05-11', '2017-11-19', 1, 35, 2, 1035, '2017-05-11 11:57:29', 1035, '2018-01-10 12:39:45', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(112, 0, 'Joomla! Volunteer Engagement Team', 'volunteer-engagement-team', 1, 59, 'VET', '<h3 id="docs-internal-guid-d1812a50-7fff-ef81-233c-1b557d5f9b4f" dir="ltr" style="text-align: center;">The VET focuses on the 3 Rs: Recruitment, Retention and Recognition of volunteers</h3>\r\n<p dir="ltr">The role of the Joomla Volunteer Engagement Team (VET) is to provide the Joomla Community with a pleasant, welcoming and healthy environment in which to contribute and share our passion for Joomla!</p>\r\n<p dir="ltr">When volunteers are happy and appreciated and they have access to the necessary knowledge and tools (both software and processes) they should feel more motivated and in turn become more productive. The VET, by supporting volunteers and the teams, strives to assist the Joomla Community to accomplish more, leading to improving the long-term stability and success of the Joomla! Project.</p>\r\n<p dir="ltr">The VET aim to achieve the above mission by focussing on three primary areas: Recruitment, Retention and Recognition.</p>\r\n<p><a href="https://docs.google.com/document/d/e/2PACX-1vR0JaugfDKk_kz5qx02JD2XIBWy1U3D6o811pbatxQQSEkAJezKCMnF0V2N0dMqJql13rnUsf6XVo_N/pub" target="_blank" rel="nofollow noopener" class="btn-info btn">Read the VET Vision, Mission and Goals</a></p>\r\n<p>By focussing on these three areas, the Volunteer Engagement Team aims to continuously deliver services to the entire Joomla community to improve communications, processes and performance across all parts of the Joomla community.</p>\r\n<p>If you would like more information on contributing to Joomla, joining VET or to provide feedback on the VET mission, values and goals statement above, please contact the VET via email at <a href="mailto:contact-vet@community.joomla.org">contact-vet@community.joomla.org</a>.</p>', 'contact-vet@community.joomla.org', 'https://www.joomla.org', '<p>Email <a href="mailto:contact-vet@community.joomla.org?subject=I%20would%20like%20to%20get%20more%20involved%20with%20Joomla!">contact-vet@community.joomla.org</a> if you would like to join the Volunteer Engagement Team, or help with any part of Joomla project, but are not sure how to get started.<br /><span id="header-text"></span></p>\r\n<p>Be sure to share some information about the area you\'re looking at getting involved in, some details about yourself, and the best way to get in touch with you to discuss your enquiry more.</p>\r\n<p>If you\'re already in the community on the Joomla Glip, message the team in the public channel: <span id="header-text"><em>Volunteer Engagement Team - public chat &amp; onboarding</em>.</span></p>', NULL, '2017-05-12', '0000-00-00', 1, 36, 27, 669, '2017-05-12 07:12:09', 2198, '2022-02-17 23:24:06', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(113, 155, 'JavaScript Working Group', 'javascript-working-group', 0, 51, 'JS WG', '', '', '', '', NULL, '2017-05-15', '0000-00-00', 1, 37, 5, 669, '2017-05-15 09:13:10', 2356, '2022-03-10 18:18:56', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(114, 61, 'Contributer Agreement Working Group', 'contributer-agreement-working-group', 1, 52, '', '<p>Review terms &amp; conditions of individual/corporate contribution and standardize it across all departments.</p>', '', '', '', NULL, '2017-05-24', '2018-02-19', 1, 38, 3, 488, '2017-05-24 08:39:03', 669, '2018-02-19 19:33:58', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(115, 112, 'Retention Team', 'retention-team', 1, 56, '', '', '', 'https://www.joomla.org', '', NULL, '2017-05-25', '2019-06-04', 1, 39, 2, 1041, '2017-05-25 18:19:29', 695, '2019-06-04 18:05:12', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(116, 112, 'Recognition Team', 'recognition-team', 1, 56, '', '', '', '', '', NULL, '2017-05-25', '2019-06-04', 1, 40, 2, 1041, '2017-05-25 18:20:21', 695, '2019-06-04 18:05:54', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(117, 112, 'Recruitment Team', 'recruitment-team', 1, 56, '', '', '', '', '', NULL, '2017-05-25', '2019-06-04', 1, 41, 2, 1041, '2017-05-25 18:20:40', 695, '2019-06-04 18:05:35', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(118, 7, 'Wikipedia Maintenance Group', 'wikipedia-maintenance-group', 0, 53, '', '<p>The purpose of the team is to maintain the Wikipedia pages of Joomla in various Languages</p>', '', '', '', NULL, '2017-06-05', '2017-10-21', 1, 42, 2, 462, '2017-06-05 14:49:09', 530, '2017-10-21 05:10:11', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(119, 61, 'Local Communities Department setup working group', 'local-communities-department-setup-working-group', 2, 52, '', '<p>A temporary team, to help facilitate the setup of a "Local Communities" department in acordance with our bylaws.</p>', '', '', '<p>This team is currently not recruiting.</p>', NULL, '2017-06-28', '2019-06-13', 1, 43, 3, 488, '2017-06-28 11:50:19', 669, '2019-06-14 06:48:11', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(120, 0, 'Privacy Compliance Team', 'compliance-team', 1, 55, '', '<p>The <strong>GDPR</strong> (General Data Protection Regulation) of the European Union will be effective on May 25, 2018.</p>\r\n<p>The Project has to evaluate the impact of such regulation and update its privacy policy and internal process accordingly.</p>\r\n<p>The aim of this team is to ensure the project compliance with such regulation.</p>\r\n<p><strong>Help and contributions are highly appreciated</strong></p>\r\n<p>&nbsp;</p>', 'compliance@community.joomla.org', '', '<p>This team has been created as working group after motion <strong>#2017/056</strong> by the Full Board of Directors and Officers of Open Source Matters.<strong><br /></strong></p>\r\n<p>This team changed name and became official team after motion <strong>#2017/089 </strong>by the Full Board of Directors and Officers of Open Source Matters.<strong><br /></strong></p>\r\n<p>If you want to be part of the Compliance Team, please apply using the form linked below.</p>\r\n<p><a href="https://goo.gl/forms/eO3omnwKeiNtEOVI2" class="btn">Apply as volunteer for GDPR Working Group</a></p>\r\n<p>&nbsp;</p>', '', '2017-08-21', '0000-00-00', 1, 44, 14, 669, '2017-08-21 14:39:48', 669, '2022-03-29 20:51:07', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(121, 78, 'Certification Ambassadors', 'certification-ambassadors', 0, 56, '', '<p id="docs-internal-guid-b335a3a8-2e66-91e7-d06b-98017ec6e819" dir="ltr">Joomla! Certification Ambassadors are volunteers who want to contribute to the Certification Program spreading the word and helping people to find useful information about it, providing basic support to the exam session organizers and also supervising exam session.</p>\r\n<p><span style="text-decoration: underline;">Exam organizers can invite a Certification Ambassador from this list to supervise their exam sessions since they are trusted Supervisors for the Joomla Certification Program.</span></p>', 'certification@community.joomla.org', 'https://certification.joomla.org', '<h2 id="docs-internal-guid-c1f07f9a-2e67-a580-f861-4ed10642ce76" dir="ltr">Who can be Certification Ambassador?</h2>\r\n<p dir="ltr">We will get in touch with all the first certified people in one Country to invite them become a Certification Ambassador. All the previous involved Regional Coordinators will be approached to â€œconvertâ€ their role in Ambassadors.</p>\r\n<h3 id="docs-internal-guid-fb678c04-2e67-daa0-4934-0c037632e4de" dir="ltr">Responsibilities</h3>\r\n<ul>\r\n<li dir="ltr">\r\n<p dir="ltr">Being â€œfacilitatorâ€ between the JCP Team and the partner network</p>\r\n</li>\r\n<li dir="ltr">\r\n<p dir="ltr">Act as Trusted Exam Supervisor when needed</p>\r\n</li>\r\n<li dir="ltr">\r\n<p dir="ltr">Spread the voice/news about the Joomla! Certification Program</p>\r\n</li>\r\n<li dir="ltr">\r\n<p dir="ltr">Report to the JCP Team eventual issues/frictions/concerns given from partners to improve the Program.</p>\r\n</li>\r\n</ul>\r\n<h3 dir="ltr">Requirements</h3>\r\n<ul>\r\n<li dir="ltr">\r\n<p dir="ltr">Be a Joomla! Exam Certified user</p>\r\n</li>\r\n<li dir="ltr">\r\n<p dir="ltr">Willing to contribute at least 5 hours per month for support, survey and others where required.</p>\r\n</li>\r\n</ul>\r\n<p id="docs-internal-guid-b335a3a8-2e68-5168-a034-1f080984fa68" dir="ltr">If you have any questions, feel free to reach us at <a href="mailto:certification@community.joomla.org">certification@community.joomla.org</a></p>\r\n<p dir="ltr">&nbsp;</p>', NULL, '2017-08-29', '0000-00-00', 1, 45, 4, 669, '2017-08-29 14:32:24', 1459, '2020-04-30 15:36:51', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(122, 0, 'Finance Working Group', 'finance-working-group', 2, 52, '', '<p>This working group is intended to support the daily job of the Treasurer of Open Source Matters.</p>', 'treasurer@opensourcematters.org', '', '', NULL, '2017-09-02', '2022-02-17', 1, 46, 2, 669, '2017-09-02 16:24:07', 2198, '2022-02-17 22:06:34', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(123, 57, 'JAT - Advisory & Testing', 'jat-at', 1, 51, '', '<p dir="ltr"><strong>Primary purpose of our subteam</strong> is to testing Joomla and deliver designers and developers practical advice on how to ensure Joomla compliance with web accessibility standards.</p>\r\n<p dir="ltr"><strong>Typical tasks</strong> include testing and evaluation Joomla system, identifying accessibility issues and making appropriate recommendations.</p>\r\n<p><span id="docs-internal-guid-c6c8869c-7fff-55a1-a139-e742d12c7bdd">If you have knowledge about web accessibility, experience in evaluating accessibility and/or testing accessibility, then this team is the right place for you.</span></p>', 's.wajda@joomla.pl', 'https://joomla.github.io/accessibility', '', NULL, '2017-10-23', '2020-01-16', 1, 47, 5, 1880, '2017-10-23 10:26:29', 632, '2020-09-04 09:59:13', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(124, 45, 'Partnership Success Team', 'partnership-success-team', 0, 52, '', '<p>A team dedicated to ensure our partnerships with other businesses and organisations are managed in a professional and satisfactory manner.</p>', '', '', '<p>Contact the department coordinator</p>', NULL, '2017-11-15', '0000-00-00', 1, 48, 2, 488, '2017-11-15 15:35:30', 669, '2018-07-05 08:17:30', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(125, 61, 'Incorporation Working Group', 'incorporation-working-group', 2, 52, '', '<p>A temporary working group to investigate potential different incorporation options for the Joomla project.</p>', '', '', '', NULL, '2017-11-15', '2019-08-08', 1, 49, 3, 488, '2017-11-15 15:39:32', 669, '2019-08-13 09:45:38', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(126, 0, 'User Research & Strategy', 'user-research-strategy', 2, 59, '', '<p>This Working Group conducts Market and User research - both of Joomla community members as well as the wider market - in order to provide meaningful data to guide strategies and decision making for Joomla as a whole as well as for individual Joomla teams.</p>\r\n<p><strong>In order to achieve its mission, this working group is looking for volunteers. Contact us at marketing [at] community.joomla.org to join and help.</strong></p>\r\n<p>&nbsp;</p>', 'david.steadson@community.joomla.org', '', '<p>If you\'re an existing Joomla community user, you can find us on Glip -&nbsp;User Research &amp; Strategy - Marketing. Otherwise contact&nbsp;<strong>marketing [at] community.joomla.org</strong>&nbsp;</p>', NULL, '2017-11-16', '0000-00-00', 1, 50, 14, 530, '2017-11-16 13:06:32', 669, '2022-03-29 20:53:47', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(127, 78, 'Certification Exam & Platform Team', 'certification-exam-platform-team', 1, 56, 'CEPT', '<p>The Certification Exam &amp; Platform Team (CET) is part of the Joomla! Certification Program for the various Joomla! exams and defining the knowledge area for each role. We are creating the questions and answers for these exams in English.&nbsp; We are also responsible to create and maintain the certification platform which consist of Exam Delivery, Learning Partners Dashboard, Payments, Enrollment and maintaining directory of Certified Users. We also monitor the exam results and update the questions and/or answers and handle the feedback from exam candidates. &nbsp;We coordinate the translation of the exams (Subteam CETT) in the different languages.</p>', 'certification@community.joomla.org', 'https://certification.joomla.org', '<p>&nbsp;</p>\r\n<p dir="ltr"><strong>What are we looking for</strong></p>\r\n<ul>\r\n<li dir="ltr">Exam &amp; Platform Team core members: to coordinate Exam Team activities and to write and review questions and/or to maintain and develop the exam platform</li>\r\n<li dir="ltr">Translators: to translate exams into other common languages (currently Italian, French, German, Polish, Spanish and Dutch)</li>\r\n<li dir="ltr">Developers to create the Developer Exam, extensions and do other development work.</li>\r\n</ul>\r\n<p><strong>Which type of people are we looking for</strong><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;"> <br /></span></p>\r\n<ul>\r\n<li dir="ltr">Willing to be involved long term, at least one year (not compulsory for translators)</li>\r\n<li dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;">Knowledge and experience in the relevant exam subject (Administrator, Developer)<span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;"></span></li>\r\n<li dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;">For Administrator exam, and developers to work on the platform, Translators / Translation coordinators: have passed the relevant certification exam or are willing to pass it.</li>\r\n<li dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;">Be generally available for weekly team meetings (Wednesdays at 20:00 CET) and/or other forms of contact</li>\r\n<li dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;">English: reading / writing and speaking at least as a second language level</li>\r\n<li dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;">Have a lot of staying power and patience because quality goes over quantity</li>\r\n<li dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;">Team spirit</li>\r\n<li dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;">Not a Joomla! Learning Partner (sorry, due to a possible conflict of interest)</li>\r\n</ul>\r\n<p><strong><a href="https://certification.joomla.org/contribute/volunteer" target="_blank" rel="noopener">Please apply through our form</a></strong></p>', NULL, '2017-11-24', '2019-02-10', 1, 51, 13, 669, '2017-11-24 19:30:04', 669, '2019-02-10 20:20:13', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(128, 78, 'Certification Exam Translations Team', 'certification-exam-translations-team-cett', 1, 56, 'CETT', '<p id="docs-internal-guid-2aff2006-7fff-e85c-7ba8-57243240dc57" dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">The Joomla! Certification exam translations team is a subteam within Certification team, with the sole purpose of working on the exam translations for the languages supported.</span></p>', '', '', '<h2>What are we looking for</h2>\r\n<p>Translators who translate the administrator exam from English into other languages.<br />Currently for the languages:</p>\r\n<ul>\r\n<li>Dutch</li>\r\n<li>French</li>\r\n<li dir="ltr">German</li>\r\n<li>Italian</li>\r\n<li dir="ltr">Polish</li>\r\n<li dir="ltr">Spanish</li>\r\n</ul>\r\n<h2><strong>Which type of people are we looking for</strong><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: bold; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline;"> </span></h2>\r\n<ul>\r\n<li dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;">Knowledge and experience in the relevant exam subject</li>\r\n<li>English: reading / writing and speaking at least as a second language level</li>\r\n<li>Willing to be involved long term</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h2>Important</h2>\r\n<ul>\r\n<li>Translators and translation coordinators have to<strong> passed the relevant certification exam</strong> or are willing to pass it</li>\r\n<li>Translators and translation coordinators <strong>cannot </strong>be a<strong> Joomla! Learning Partne</strong>r (sorry, due to a possible conflict of interest)</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h2>Application as translator/translation coordinator</h2>\r\n<p><a href="https://certification.joomla.org/contribute/volunteer">Please apply through our form</a></p>\r\n<p>&nbsp;</p>', NULL, '2017-11-29', '0000-00-00', 1, 52, 21, 1093, '2017-11-29 19:28:53', 2198, '2019-03-24 15:40:08', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(129, 78, 'Certification Operations & Marketing Team', 'certification-operations-marketing-team', 1, 56, 'COMT', '<p>COMT is the liaison for interested trainers, Joomla! Learning Partners (JLP), JoomlaDays, Joomla! User Groups and Supervisors answering questions about the certification process, providing contracts, etc. We also support the Joomla! Certification Program with marketing and communication. Our team will be having an ongoing dialogue with the community to get feedback on the Joomla! Certification.</p>', 'certification@community.joomla.org', 'https://certification.joomla.org', '<p>There are several ways you can contribute to the Joomla! Certification Operations &amp; Marketing Team.</p>\r\n<p>A permanent call for volunteers is open at <a href="https://certification.joomla.org/contribute/volunteer">https://certification.joomla.org/contribute/volunteer</a></p>\r\n<p>There you can choose in which area you would to be involved.</p>\r\n<h3>Certification Ambassadors</h3>\r\n<p>Certification Ambassadors are "facilitators", serving as link between the partner network (JLPs, JUG &amp; JoomlaDays organisers) and the Certification Operations Team.</p>\r\n<p>If you would like to contribute as Certification Ambassador in your region, just fill out the form at the following page: <a href="https://certification.joomla.org/contribute/regional-coordinator">https://certification.joomla.org/contribute/regional-coordinator</a></p>', NULL, '2017-11-30', '2019-02-10', 1, 53, 4, 669, '2017-11-30 20:41:40', 669, '2019-02-10 20:20:46', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(130, 57, 'JAT- Implementation & Development ', 'jat-implementation-development', 0, 51, '', '<p dir="ltr"><strong>Primary purpose of our subteam</strong> is to develop and implement solutions and patterns of design that will improve Joomla accessibility.</p>\r\n<p dir="ltr"><strong>Typical tasks</strong> include writing of Joomla code patches to fixes accessibility errors, &nbsp;and improving user experience.</p>\r\n<p><span id="docs-internal-guid-4b4cc0a4-7fff-f732-ee04-f2af23eb0b36">If you are familiar with one of the following technologies PHP, HTML, JavaScript and CSS are happy working with code then this team is for you.</span></p>', '', '', '', NULL, '2017-12-15', '0000-00-00', 1, 54, 3, 1880, '2017-12-15 10:05:52', 2591, '2019-01-29 13:39:32', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(131, 57, 'JAT - Documentation & Support', 'jat-ds', 0, 51, '', '<p dir="ltr"><strong>Primary purpose of our subteam</strong> is to prepare documentation and define guidelines for designers, programmers and administrators, in the area of Joomla accessibility.</p>\r\n<p dir="ltr"><strong>Typical tasks</strong> include proofreading of technical documentation and creating useful tutorials for extension developers and site designers to help them comply with ATAG and WCAG.</p>\r\n<p><span id="docs-internal-guid-60ce3f29-7fff-d368-f958-7c48646d97d0">If you&nbsp;have written or improved help texts, handbooks, technical documents etc., this could be your teamâ€¦</span></p>', '', '', '', NULL, '2017-12-15', '2020-01-16', 1, 55, 6, 1880, '2017-12-15 10:06:16', 632, '2020-09-04 10:05:53', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(132, 7, 'Joomla 4 Marketing Design', 'joomla-4-marketing-design', 2, 53, '', '<p>Team in charge of the marketing design for J4 (landing page, teasing campaign, products... all related to imagery)</p>', 'marketing@community.joomla.org', '', '', NULL, '2017-11-16', '2020-12-17', 1, 56, 3, 530, '2018-01-13 12:46:57', 6731, '2020-12-17 19:54:35', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(133, 0, 'Advisory Board', 'advisory-board', 1, 58, '', '<p>The Advisory Board members (3-9 people) gives input and advice to the Board of Directors, <br />based on topics raised by anyone in the Joomla! Community including the Board themselves.<br />The Advisory Board is an independent group without voting rights in the organization, <br />but with the right to put an item on the agenda within the Board of Directors meeting.<br /><br />Anyone within the Community can raise topics to the Advisory Board, which allows to put focus on issues of great importance.<br />To add an item to the agenda of the Board of Directors there needs to be a majority vote with a valid quorum in an Advisory Board meeting.</p>', 'advisory-board@opensourcematters.org', 'https://www.opensourcematters.org', '', '', '2018-02-12', '0000-00-00', 1, 57, 5, 430, '2018-02-12 20:13:17', 2198, '2021-03-24 20:11:16', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(134, 0, 'Ombudsman', 'ombudsman', 1, 58, '', '<p id="docs-internal-guid-8f2c98a7-594d-9be4-3deb-864c839bdb0b" dir="ltr">The role of the ombudsman structure is to act as an oversight and appeals function for the community at a large.</p>\r\n<p dir="ltr">The ombudsman structure will be the appeals option for teams that have been dissolved, or individuals who have been removed from a position due to breach of COI or by vote of no confidence.</p>\r\n<p id="docs-internal-guid-8f2c98a7-594e-690e-124c-5b859f9a35bf" dir="ltr">Code of Conduct (CoC) is also handled by the ombudsman structure. If anyone is seen or believed to have breached the Code of Conduct they can report it to the ombudsman structure that will then deal with it and assess it. If it is found to be assessed as there has been a breach of the CoC the ombudsman can put the case on the next meeting of the Board of Directors for handling.</p>', 'ombudsman@opensourcematters.org', '', '', '', '2018-02-12', '0000-00-00', 1, 58, 3, 430, '2018-02-12 20:13:32', 669, '2020-05-24 18:45:35', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(135, 57, 'JAT- Education & Promotion', 'jat-promotion', 0, 51, '', '<p dir="ltr"><strong>Primary purpose of our subteam</strong> is to raise awareness and understanding of accessibility issues &nbsp;and involve the community in efforts to improve Joomla accessibility.</p>\r\n<p dir="ltr"><strong>Typical tasks include</strong> design of materials promoting accessibility, creation of educational material, writing articles and information</p>\r\n<p><span id="docs-internal-guid-06fb04bd-7fff-53a0-f0a3-bb17ed88cbf0">If you have energy, ideas or charisma about how to &nbsp;create more engagement on accessibility, this could be your team</span></p>', '', '', '', NULL, '2018-03-26', '2020-01-16', 1, 59, 3, 1880, '2018-03-26 15:54:31', 632, '2020-09-04 09:59:51', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(136, 24, 'GSoC 18 Webservices in Joomla', 'gsoc-18-web-services-in-joomla', 1, 51, '', '<p>Project Description:&nbsp;<a href="https://docs.joomla.org/GSOC_2018_Project_Ideas#Project_I:_Webservices_in_Joomla.21">https://docs.joomla.org/GSOC_2018_Project_Ideas#Project_I:_Webservices_in_Joomla.21</a>&nbsp;<br /><br />Official GSoC 18 Subteam&nbsp;</p>\r\n<p>Github Repo:&nbsp;<a href="https://github.com/joomla-projects/gsoc18_webservices">https://github.com/joomla-projects/gsoc18_webservices</a>&nbsp;</p>', 'gsoc@opensourcematters.org', '', '', NULL, '2018-04-24', '2018-12-28', 1, 60, 3, 525, '2018-04-24 05:10:59', 525, '2018-12-28 07:19:17', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
