	(146, 7, 'Joomla 4 Marketing Team', 'joomla-4-marketing-team', 0, 53, '', '<h2 style="font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; color: #333333;">Use your marketing skills to help promote Joomla!</h2>\r\n<h3 style="font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; color: #333333;">Join the Marketing Team!</h3>\r\n<p>If you have some experience in a marketing environment and have some time to contribute we need your help. No matter your time availability, we would love to have you use your skills in marketing to help promote Joomla! Through its second decade.</p>\r\n<p>If you have any of these skills (or others related to marketing that we didnâ€™t list above) please contact us using the link below and let us know a bit about yourself and weâ€™ll help you get plugged into the best team for your skills.</p>\r\n<p>What? You donâ€™t have ANY of these skills but still want to help let everyone in the world know how great Joomla! Is? You can contact us too and tell us about your skills and weâ€™ll see if we have a place for you. Even though we are focused on marketing we still need help in translating, team management, some coding and other basic web-type-stuff tasks that you might be able to help. And weâ€™ll even help you learn some of the skills that go into the marketing process.</p>\r\n<p>To find where you fit on the Marketing Team please visit our team area at&nbsp;<a href="teams/marketing" title="Joomla! Marketing Team">https://volunteers.joomla.org/teams/marketing</a>&nbsp;and take a look at the various "sub-teams".&nbsp;Ready to get started ?</p>\r\n<p><a href="https://forms.gle/XxPJjwtB8HDpcjqL9" target="_blank" rel="noopener noreferrer" class="btn btn-primary btn-large">Apply Now!</a></p>\r\n<p>&nbsp;</p>', 'marketing@community.joomla.org', '', '', NULL, '2018-12-13', '0000-00-00', 1, 70, 7, 530, '2018-12-13 14:44:00', 6731, '2021-02-14 08:42:32', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(147, 0, 'Global Events Fund Working Group', 'joomla-global-events-fund', 0, 59, '', '', 'djamel.kherbi@community.joomla.org', '', '<p>&nbsp;<strong>Become a Global Events Fund Working Group Member.</strong></p>\r\n<p dir="ltr">The Global Events Fund Working Group has been created as a new sponsorship initiative for JoomlaDays. We need people you are willing to commit to work on this new program and help us to improve this new sponsorship program to all related Joomla! Events around the world.</p>\r\n<p><span id="docs-internal-guid-302eac4d-7fff-821e-beeb-0bb6c3c871d5"><strong>Communications:</strong>&nbsp;</span></p>\r\n<ul>\r\n<li>Polite, friendly, clear communication at all times (including on personal social media)</li>\r\n<li>Check your email at least daily and respond to anything that needs action.</li>\r\n<li>Attend team meetings or give advance notice for absence. If two or more meetings are missed without apologies you will be moved to the â€œhonour rollâ€.</li>\r\n</ul>\r\n<p dir="ltr"><strong>We are looking for specific skills and expertise related to sponsorship, Finance, Fundraising, Public relation and Marketing.</strong></p>\r\n<ul>\r\n<li dir="ltr">Public Relations (prepare Press Releases, Social Media)</li>\r\n<li dir="ltr">Sponsor Relations (responsible to find sponsors, fundraisers)</li>\r\n<li dir="ltr">Events Team Liaison (responsible to connect with Events Team and outreach to Event Organizers)</li>\r\n<li dir="ltr">Finance Review (responsible to check budgets and process financial requests, liaison &nbsp;with Treasurer)</li>\r\n<li dir="ltr">Marketer (responsible to prepare marketing materials)</li>\r\n</ul>\r\n<p dir="ltr">Please fill out the <a href="https://joom.la/globalevents">member application form</a> if you are interested in being a member of the Global Events Fund Working Group.</p>\r\n<p dir="ltr">Thank you.</p>', NULL, '2018-12-21', '0000-00-00', 1, 71, 5, 468, '2018-12-21 17:07:03', 669, '2022-03-29 20:55:28', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(148, 0, 'Marketing Local Community Liaison', 'marketing-local-community-liaison', 2, 59, '', '<p>Liaison between the Joomla Marketing Team and the local communities to increase awareness and communication. You want to become the liaison for your community? Contact us at marketing[at]community.joomla.org</p>\r\n<p><strong>What does being a \'liaison\' mean?</strong> <br /><br />It\'s easy, the liaison will receive, prior publishing, most Joomla Official Communication and materials. They will be informed of upcoming marketing plans. In that way, they can translate the resources and publish them at the same time as Joomla Official Properties to raise awareness in their country. <br /><br />It allows also to improve communication between jorg and our local communities.</p>', 'sandra.thevenet@community.joomla.org', '', '<p>You want to become the liaison for your community? Contact us at marketing[at]community.joomla.org</p>', NULL, '2018-09-29', '0000-00-00', 1, 72, 4, 530, '2019-01-17 13:38:18', 669, '2022-03-29 20:52:45', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(149, 0, 'Software Architecture & Strategy Team', 'software-architecture-strategy-working-group', 1, 51, 'SA&S', '<p style="text-align: center;">Software Architecture &amp; statgegy is a voting <a href="departments/production">production department team</a><br />The best argument that can be made for â€œSoftware architecture &amp; Strategyâ€ ( â€œSA&amp;Sâ€ ) came from one of the production teams leads.</p>\r\n<p style="text-align: center;">â€œThat is not how we develop software, we do not need it..â€</p>\r\n<p style="text-align: center;"><a href="https://en.wikipedia.org/wiki/Software_architecture">Software architecture - Wikipedia</a>*</p>\r\n<p>Looking back Joomla has failed to be successful in putting out consistent quality or â€œapprovedâ€ code (i.e UCM, Tags, Custom Fields). Typically development starts when somebody feels that there is an itch to scratch, Then at the time of a pull request some other developer with the same itch will comment and possibly things have changed around (as with custom fields).</p>\r\n<p>Worst case the changes go in â€œunnoticedâ€ and we end up complaining afterwards (as with tags). The end result is we have frustrated developers that feel their time was wasted or an unhappy community wrt a sub par implementation of a feature.</p>\r\n<p>Feedback on pull requests is always valuable, everybody\'s effort is appreciated and the mechanism should be cherished. There is however a way that we can improve on this, whilst lowering frustration and increasing professionalism.</p>\r\n<p>If we look to professional software development in the industry a reference is always made &nbsp;to architecture, the blueprint for how functionality is to be added/modified and with what constraints. Software architecture helps to reduce the chance of failure and minimise risk*. The architecture view is the helicopter overview he is not typically the developer.</p>\r\n<p>If we use a comparison to a building and its associated architecture, the architect is not a mason, plumber or electrician ( he might have been in the past). They architect defines framework for the foundations and layout that is built on top whilst estimating how much of what (bricks, cement, etc) needs to go where. Architecture and Strategy go hand in hand in that comparison as the size of the plot and the strength of the foundation laid on top of it is the cornerstone of future strategy.</p>\r\n<p>Joomla lacks a â€œbodyâ€ of developers that the production department can turn to for questions on architecture and support. Joomla also lacks a body that has the skillset to structurally review larger functional improvements such as workflow and a rewrite of tags. It lacks a body to lay out a technical foundation for the future. Having this body to reference would help the developer implement the best possible solution by having an â€œencyclopediaâ€ of knowledge to go to when it comes to major decisions.</p>\r\n<p>That advantage of having a body of people, instead of an individual, to advise would also mitigate the point of individual criticism. `I discard what person ABC says because he\'s alwaysâ€¦. Having a body to advise/help should also help continuity as knowledge and history should be anchored in that body and not in the head of a single individual.</p>\r\n<p>Having a balanced group shall also ensure a balance between a â€œhackedâ€ and â€œtheoreticalâ€ architecture approach.</p>\r\n<p>The architecture and strategy team shall play an advisory role within the production department.</p>\r\n<p>Its actions can be triggered from within the group itself or from de production department. Its focus is explicitly technical. <br />Overall project strategy is more than technical, Joomlaâ€™s roadmap should consider more than technology alone, for example marketing. &nbsp;There is no structural way of doing that yet, that\'s a discussion at another level. A representative of SA&amp;S should take part in that, but requests should always flow through the Production Department.</p>\r\n<p>For sure there will be challenges to overcome because for the lack of a better word we are a collection of egoâ€™s, both inside such a body as in the developer community. Careful and Mindful communication would be key!</p>\r\n<p>It is proposed to rebrand Joomla!X to â€œSoftware Architecture &amp; Strategyâ€, there is a 90% overlap in goals. The big difference being the lack of coding and explicit focus on advice.</p>', 'niels.braczek@community.joomla.org', '', '<p>Participation is typically on invitatoin and proven architectural and technical prowess. Please use the contact form to get involved or propose someone a member/contributor</p>', NULL, '2019-04-04', '0000-00-00', 1, 73, 11, 669, '2019-04-04 09:08:57', 625, '2021-02-22 12:30:06', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(150, 0, 'Educational Outreach', 'educational-outreach', 2, 59, 'JEO', '<p>The mission of the Joomla Educational Outreach Working Group is:</p>\r\n<p><span id="docs-internal-guid-bbe88349-7fff-0d13-0b7f-650a366deb2d">T</span><span id="docs-internal-guid-bbe88349-7fff-0d13-0b7f-650a366deb2d">o be a hub of teaching tools and resources for those who want to teach and learn Joomla around the world</span></p>\r\n<p>To achieve our mission we need volunteers that will help us to&nbsp;<strong>Entice. Engage. Educate.</strong></p>\r\n<p>In order to devote our team\'s efforts to a successful launch of Joomla 4, we have decided to pause the work of the Educational Research Working Group,&nbsp;since the members are active in other&nbsp;teams across the Joomla&nbsp;Project.</p>\r\n<div class="gmail_default" style="font-family: verdana,sans-serif;">Joomla is a volunteer effort, and we need all hands to move the project forward.&nbsp; If you want to be a part of this working group, or any part of the Joomla Project, please use the contact tab below.<br /><br /></div>', '', '', '<p>We are looking for teaching materials, resources, and individuals to help with gathering these materials. &nbsp;In the <a href="#contact">contact form</a>&nbsp;on the Contact tab above,&nbsp;please let us know how you\'d like to help and we will get back to you.</p>', NULL, '2019-04-04', '0000-00-00', 1, 74, 12, 695, '2019-04-04 17:47:48', 2198, '2022-02-17 23:26:47', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(151, 24, 'Google Season of Docs', 'google-season-of-docs', 1, 51, '', '<p>This team will work on Joomla\'s participation with Google Season of Docs, to read more about the program, check here:&nbsp;<a href="https://docs.joomla.org/Google_Season_of_Docs_2019">https://docs.joomla.org/Google_Season_of_Docs_2019</a>&nbsp;</p>', 'gsod@community.joomla.org', '', '<p>Drop us a message at <a href="mailto:gsod@community.joomla.org" target="_blank">gsod@community.joomla.org</a></p>', NULL, '2019-04-06', '2019-05-12', 1, 75, 3, 525, '2019-04-06 05:02:10', 525, '2019-05-12 09:18:10', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(152, 24, 'GSOC 19 Page Builder Project', 'gsoc-19-page-builder-project', 1, 51, '', '<p>Read here for Description:</p>\r\n<p>&nbsp;</p>\r\n<p><a href="https://docs.joomla.org/GSOC_2019_Project_Ideas#Project_II:_New_frontend_template:_Page-builder">https://docs.joomla.org/GSOC_2019_Project_Ideas#Project_II:_New_frontend_template:_Page-builder</a>&nbsp;</p>', 'gsoc@joomla.org', '', '', NULL, '2019-05-10', '2019-09-15', 1, 76, 2, 525, '2019-05-10 14:27:53', 525, '2019-09-17 08:10:31', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(153, 24, 'Webservices for Joomla 4', 'webservices-for-joomla-4', 1, 51, '', '<p>Read more about Description here:</p>\r\n<p>&nbsp;</p>\r\n<p><a href="https://docs.joomla.org/GSOC_2019_Project_Ideas#Project_I:_Webservices_in_Joomla">https://docs.joomla.org/GSOC_2019_Project_Ideas#Project_I:_Webservices_in_Joomla</a></p>', 'gsoc@joomla.org', '', '', NULL, '2019-05-10', '2019-09-15', 1, 77, 2, 525, '2019-05-10 14:32:06', 525, '2019-09-17 08:10:42', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(154, 24, 'GSOC 19 Joomla 4 Feature Enhancements', 'gsoc-19-joomla-4-feature-enhancements', 1, 51, '', '<p>Read More about team details here:&nbsp;</p>\r\n<p><a href="https://docs.joomla.org/GSOC_2019_Project_Ideas#Project_IV:_Joomla_4_Feature_Enhancements">https://docs.joomla.org/GSOC_2019_Project_Ideas#Project_IV:_Joomla_4_Feature_Enhancements</a></p>', '', '', '', NULL, '2019-05-10', '2019-07-21', 1, 78, 3, 525, '2019-05-10 14:38:15', 525, '2019-07-22 16:32:25', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(155, 0, 'Joomla! Enhancement Development Team', 'joomla-enhancement-development-team', 1, 51, '', '<p>The umbrella team for all working groups developing future functions for Joomla!</p>', '', '', '', NULL, '2019-06-13', '0000-00-00', 1, 79, 4, 547, '2019-06-19 07:47:00', 2356, '2019-06-19 13:52:42', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(156, 155, 'Page Builder Working Group', 'page-builder-working-group', 2, 51, 'JEDT - PB', '<p>This working group implements the new Page Builder for Joomla!</p>', '', 'https://github.com/joomla-projects/gsoc19_page-builder', '', NULL, '2019-08-28', '0000-00-00', 1, 80, 3, 2356, '2019-08-28 15:16:11', 2356, '2019-08-28 15:35:08', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
