	(159, 0, 'Community Sites Team', 'community-sites-team', 1, 55, '', '<p>The Joomla Community site (CJO) is the website which holds various services and information for the community.<br />Topics like; News, Events Directory, User Groups Directory, Service Providers Directory, Newsletters, Sponsoring and many other things.<br /><br />This team is responsible for all assets within this website as well for the www.joomla.org site.<br />The team consists of direct members and from other teams, who use a part of the different sites.</p>', 'operations-dc@community.joomla.org', 'https://community.joomla.org', '', NULL, '2020-06-19', '0000-00-00', 1, 83, 10, 2198, '2020-06-19 18:45:11', 547, '2022-12-11 18:22:47', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(160, 155, 'Frontend Template Working Group', 'frontend-template-working-group', 2, 51, 'JEDT - FT', '', '', '', '', NULL, '2020-07-17', '2020-12-01', 1, 84, 2, 2356, '2020-07-17 15:35:53', 2356, '2021-05-13 13:22:34', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(161, 0, 'Joomla Translation Program Team', 'joomla-translation-program-team', 1, 59, 'JTP', '<p>The Joomla Translation Program Team coordinates and supervises the work of hundreds of volunteers globally that translate the Joomla CMS, the official websites, documentation and marketing materials into many different languages.<br /><br />Check the Joomla! Documentation website for more information <a href="https://docs.joomla.org/Special:MyLanguage/Joomla_Translation_Program">https://docs.joomla.org/Joomla_Translation_Program</a> <br />Get started helping with translations by signing up to the Joomla! Crowdin workspace at <a href="https://joomla.crowdin.com" target="_blank" rel="noopener">https://joomla.crowdin.com</a></p>', 'marketing-dc@community.joomla.org', '', '', NULL, '2021-03-01', '0000-00-00', 1, 85, 6, 2198, '2021-03-06 10:09:42', 2198, '2022-02-17 22:45:27', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(162, 51, 'Joomla! CMS (Core) Language Team', 'joomla-cms-language-team', 2, 51, '', '<p>The Joomla CMS Language Team is responsible for the translation of the Joomla CMS into different languages.<br />Anyone can help translate Joomla into their language via the CrowdIn account <a href="https://joomla.crowdin.com" target="_blank" rel="noopener" title="Joomla Crowdin">here</a>.<br />If your language isnâ€™t yet available, please let us know and weâ€™ll get it set up ready for you to start translating.<br /><br />Questions / Issues can be raised here:<br /><a href="https://github.com/joomla/core-translations" target="_blank" rel="noopener" title="Github Joomla Core Translariona">https://github.com/joomla/core-translations</a></p>', 'stefan.wendhausen@community.joomla.org', '', '', NULL, '2021-03-01', '0000-00-00', 1, 86, 5, 2198, '2021-03-07 10:07:17', 2198, '2022-02-05 09:47:48', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
	(163, 161, 'Joomla! Resources Language Team', 'joomla-resources-language-team', 2, 56, '', '<p>The Community Translation Team is responsible for the localisation needed within The Joomla! Project, for sites, announcements, marketing, official extensions etc. You can find all the localised Joomla\'s Projects <a href="https://joomla.crowdin.com" title="Localised Joomla\'s Projects on Crowdin">here</a></p>\r\n<p><strong>Projects:</strong></p>\r\n<ul>\r\n<li>Marketing Resources<br /><a href="https://joomla.crowdin.com/marketing-resources">https://joomla.crowdin.com/marketing-resources</a></li>\r\n<li>Joomla Websites template<br /><a href="https://joomla.crowdin.com/joomla-official-website-template">https://joomla.crowdin.com/joomla-official-website-template</a></li>\r\n<li>Joomla Official websites<br /><a href="https://joomla.crowdin.com/joomla-official-websites">https://joomla.crowdin.com/joomla-official-websites</a></li>\r\n<li>Joomla Official Extensions<br /><a href="https://joomla.crowdin.com/joomla-official-extensions">https://joomla.crowdin.com/joomla-official-extensions</a></li>\r\n</ul>', 'wilco.alsemgeest@community.joomla.org', '', '', NULL, '2021-03-01', '0000-00-00', 1, 87, 6, 2198, '2021-03-08 20:10:56', 2198, '2021-08-16 07:45:17', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
