	(172, 155, 'Signed Updates', 'signed-updates', 2, 51, 'JEDT - SU', '<p><span style="color: #121212; font-family: Lato, Helvetica, Arial, sans-serif; font-size: 15px; white-space: pre-wrap; background-color: rgba(249, 249, 249, 0.6);">Progress on this topic is planed in march at the CF Hackthon </span><a href="https://www.cloudfest.com/project/joomla-tuf-secure-updates" target="_blank" rel="noopener noreferrer" style="text-decoration-line: underline; color: #4237c8; font-family: Lato, Helvetica, Arial, sans-serif; font-size: 15px; white-space: pre-wrap; background-color: rgba(249, 249, 249, 0.6);" tabindex="-1">https://www.cloudfest.com/project/joomla-tuf-secure-updates</a></p>', '', '', '', NULL, '2022-02-20', '0000-00-00', 1, 96, 1, 2497, '2022-02-20 09:06:45', 0, '2022-02-20 09:06:45', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
