	(179, 0, 'Joomla Experience Team', 'joomla-experience-team', 1, 51, 'JXT', '<p>The JXT is committed to improving the experience of the Joomla CMS and broader community surrounding it.</p>', 'crystal.dionysopoulos@community.joomla.org', '', '<p>The JXT has developed a three-pronged approach to improving the experience of the Joomla CMS and broader ecosystem:</p>\r\n<ul>\r\n<li><strong>Damage Control and Quality Assurance:&nbsp;</strong>Bring attention to current bugs and issues to improve the experience in the CMS as it exists now, review PRs when necessary or requested. Track common issues and questions to help discover usability bugs.</li>\r\n<li><strong>Guidance and Best Practices:</strong>&nbsp;Produce research-based strategy and documentation to help guide other teams with their decisions in order to ensure a consistent Joomla experience across the ecosystem as a whole.</li>\r\n<li><strong>Visionary, Long Term Thinking:</strong>&nbsp;Assist with roadmaps and goals for future releases and decisions, in order to ensure the sustainable and consistent growth of the CMS and Joomla Ecosystem.</li>\r\n</ul>\r\n<p>If this something you\'d like to help with, first review the roles tab and then please <a href="https://airtable.com/shrS8wFIFxxfsyCPn">submit the interest form here</a>. Thank you!&nbsp;</p>', NULL, '2022-08-16', '0000-00-00', 1, 103, 8, 2356, '2022-08-16 14:34:50', 669, '2022-10-20 12:52:56', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00');
